trsuperobject.biblemap.put("b19_10_17", new trsuperobject(19,10,17,"Mazlumların dileğini duyarsın, ya RAB,Yüreklendirirsin onları,Kulağın hep üzerlerinde;"));
trsuperobject.biblemap.put("b19_10_18", new trsuperobject(19,10,18,"Öksüze, düşküne hakkını vermek için,Bir daha dehşet saçmasın ölümlü insan."));
trsuperobject.biblemap.put("b19_11_1", new trsuperobject(19,11,1,"Ben RABbe sığınırım,Nasıl dersiniz bana,‹‹Kuş gibi kaç dağlara."));
trsuperobject.biblemap.put("b19_11_2", new trsuperobject(19,11,2,"Bak, kötüler yaylarını geriyor,Temiz yürekli insanlarıKaranlıkta vurmak içinOklarını kirişine koyuyor."));
trsuperobject.biblemap.put("b19_11_3", new trsuperobject(19,11,3,"Temeller yıkılırsa,Ne yapabilir doğru insan?››"));
trsuperobject.biblemap.put("b19_11_6", new trsuperobject(19,11,6,"Kötülerin üzerine kızgın korlar ve kükürt yağdıracak,Paylarına düşen kâse kavurucu rüzgar olacak."));
trsuperobject.biblemap.put("b19_11_7", new trsuperobject(19,11,7,"Çünkü RAB doğrudur, doğruları sever;Dürüst insanlar O'nun yüzünü görecek. kesin olarak bilinmiyor."));
trsuperobject.biblemap.put("b19_12_1", new trsuperobject(19,12,1,"Kurtar beni, ya RAB, sadık kulun kalmadı,Güvenilir insanlar yok oldu."));
trsuperobject.biblemap.put("b19_12_2", new trsuperobject(19,12,2,"Herkes birbirine yalan söylüyor,Dalkavukluk, ikiyüzlülük ediyor."));
trsuperobject.biblemap.put("b19_12_3", new trsuperobject(19,12,3,"Sustursun RAB dalkavukların ağzını,Büyüklenen dilleri."));
trsuperobject.biblemap.put("b19_12_4", new trsuperobject(19,12,4,"Onlar ki, ‹‹Dilimizle kazanırız,Dudaklarımız emrimizde,Kim bize efendilik edebilir?›› derler."));
trsuperobject.biblemap.put("b19_12_5", new trsuperobject(19,12,5,"‹‹Şimdi kalkacağım›› diyor RAB,‹‹Çünkü mazlumlar eziliyor,Yoksullar inliyor,Özledikleri kurtuluşu vereceğim onlara.››"));
trsuperobject.biblemap.put("b19_12_7", new trsuperobject(19,12,7,"Sen onları koru, ya RAB,Bu kötü kuşaktan hep uzak tut!"));
trsuperobject.biblemap.put("b19_12_8", new trsuperobject(19,12,8,"İnsanlar arasında alçaklık rağbet görünce,Kötüler her yanda dolaşır oldu."));
trsuperobject.biblemap.put("b19_13_1", new trsuperobject(19,13,1,"Ne zamana dek, ya RAB,Sonsuza dek mi beni unutacaksın?Ne zamana dek yüzünü benden gizleyeceksin?"));
trsuperobject.biblemap.put("b19_13_2", new trsuperobject(19,13,2,"Ne zamana dek içimde tasa,Yüreğimde hep keder olacak?Ne zamana dek düşmanım bana üstün çıkacak?"));
trsuperobject.biblemap.put("b19_13_3", new trsuperobject(19,13,3,"Gör halimi, ya RAB, yanıtla Tanrım,Gözlerimi aç, ölüm uykusuna dalmayayım."));
trsuperobject.biblemap.put("b19_13_4", new trsuperobject(19,13,4,"Düşmanlarım, ‹‹Onu yendik!›› demesin,Sarsıldığımda hasımlarım sevinmesin."));
trsuperobject.biblemap.put("b19_13_5", new trsuperobject(19,13,5,"Ben senin sevgine güveniyorum,Yüreğim kurtarışınla coşsun."));
trsuperobject.biblemap.put("b19_13_6", new trsuperobject(19,13,6,"Ezgiler söyleyeceğim sana, ya RAB,Çünkü iyilik ettin bana."));
trsuperobject.biblemap.put("b19_14_1", new trsuperobject(19,14,1,"Akılsız içinden, ‹‹Tanrı yok!›› der.İnsanlar bozuldu, iğrençlik aldı yürüdü,İyilik eden yok."));
trsuperobject.biblemap.put("b19_14_3", new trsuperobject(19,14,3,"Hepsi saptı,Tümü yozlaştı,İyilik eden yok,Bir kişi bile!"));
trsuperobject.biblemap.put("b19_14_4", new trsuperobject(19,14,4,"Suç işleyenlerin hiçbiri görmüyor mu?Halkımı ekmek yer gibi yiyor,RABbe yakarmıyorlar."));
trsuperobject.biblemap.put("b19_14_5", new trsuperobject(19,14,5,"Dehşete düşecekler yeryüzünde,Çünkü Tanrı doğruların yanındadır."));
trsuperobject.biblemap.put("b19_14_6", new trsuperobject(19,14,6,"Mazlumun tasarılarını boşa çıkarırdınız,Ama RAB onun sığınağıdır."));
trsuperobject.biblemap.put("b19_14_7", new trsuperobject(19,14,7,"Keşke İsrail'in kurtuluşu Siyon'dan gelse!RAB halkını eski gönencine kavuşturunca,Yakup soyu sevinecek, İsrail halkı coşacak."));
trsuperobject.biblemap.put("b19_15_1", new trsuperobject(19,15,1,"Ya RAB, çadırına kim konuk olabilir?Kutsal dağında kim oturabilir?"));
trsuperobject.biblemap.put("b19_15_2", new trsuperobject(19,15,2,"Kusursuz yaşam süren, adil davranan,Yürekten gerçeği söyleyen."));
trsuperobject.biblemap.put("b19_15_3", new trsuperobject(19,15,3,"İftira etmez,Dostuna zarar vermez,Komşusuna kara çalmaz böylesi."));
trsuperobject.biblemap.put("b19_15_4", new trsuperobject(19,15,4,"Aşağılık insanları hor görür,Ama RABden korkanlara saygı duyar.Kendi zararına ant içse bile, dönmez andından."));
trsuperobject.biblemap.put("b19_15_5", new trsuperobject(19,15,5,"Parasını faize vermez,Suçsuza karşı rüşvet almaz.Böyle yaşayan asla sarsılmayacak."));
trsuperobject.biblemap.put("b19_16_1", new trsuperobject(19,16,1,"Koru beni, ey Tanrı,Çünkü sana sığınıyorum."));
trsuperobject.biblemap.put("b19_16_3", new trsuperobject(19,16,3,"Ülkedeki kutsallara gelince,Soyludur onlar, biricik zevkim onlardır."));
trsuperobject.biblemap.put("b19_16_4", new trsuperobject(19,16,4,"Başka ilahların ardınca koşanların derdi artacak.Onların kan sunularını dökmeyeceğim,Adlarını ağzıma almayacağım."));
trsuperobject.biblemap.put("b19_16_5", new trsuperobject(19,16,5,"Benim payıma,Benim kâseme düşen sensin, ya RAB;Yaşamım senin ellerinde."));
trsuperobject.biblemap.put("b19_16_6", new trsuperobject(19,16,6,"Payıma ne güzel yerler düştü,Ne harika bir mirasım var!"));
trsuperobject.biblemap.put("b19_16_7", new trsuperobject(19,16,7,"Övgüler sunarım bana öğüt veren RABbe,Geceleri bile vicdanım uyarır beni."));
trsuperobject.biblemap.put("b19_16_8", new trsuperobject(19,16,8,"Gözümü RABden ayırmam,Sağımda durduğu için sarsılmam."));
trsuperobject.biblemap.put("b19_16_9", new trsuperobject(19,16,9,"Bu nedenle içim sevinç dolu, yüreğim coşuyor,Bedenim güven içinde."));
trsuperobject.biblemap.put("b19_16_10", new trsuperobject(19,16,10,"Çünkü sen beni ölüler diyarına terk etmezsin,Sadık kulunun çürümesine izin vermezsin. kulunun ölüm çukurunu görmesine izin vermezsin.››"));
trsuperobject.biblemap.put("b19_16_11", new trsuperobject(19,16,11,"Yaşam yolunu bana bildirirsin.Bol sevinç vardır senin huzurunda,Sağ elinden mutluluk eksilmez."));
trsuperobject.biblemap.put("b19_17_1", new trsuperobject(19,17,1,"Haklı davamı dinle, ya RAB,Feryadımı işit!Hilesiz dudaklardan çıkan duama kulak ver!"));
trsuperobject.biblemap.put("b19_17_2", new trsuperobject(19,17,2,"Haklı çıkar beni,Çünkü sen gerçeği görürsün."));
trsuperobject.biblemap.put("b19_17_3", new trsuperobject(19,17,3,"Yüreğimi yokladın,Gece denedin,Sınadın beni,Kötü bir şey bulmadın;Kararlıyım, ağzımdan kötü söz çıkmaz,"));
trsuperobject.biblemap.put("b19_17_4", new trsuperobject(19,17,4,"Başkalarının yaptıklarına gelince,Ben senin sözlerine uyarakŞiddet yollarından kaçındım."));
trsuperobject.biblemap.put("b19_17_5", new trsuperobject(19,17,5,"Sıkı adımlarla senin yollarını tuttum,Kaymadı ayaklarım."));
trsuperobject.biblemap.put("b19_17_6", new trsuperobject(19,17,6,"Sana yakarıyorum, ey Tanrı,Çünkü beni yanıtlarsın;Kulak ver bana, dinle söylediklerimi!"));
trsuperobject.biblemap.put("b19_17_7", new trsuperobject(19,17,7,"Göster harika sevgini,Ey sana sığınanları saldırganlardan sağ eliyle kurtaran!"));
trsuperobject.biblemap.put("b19_17_8", new trsuperobject(19,17,8,"Koru beni gözbebeği gibi;Kanatlarının gölgesine gizle"));
trsuperobject.biblemap.put("b19_17_9", new trsuperobject(19,17,9,"Kötülerin saldırısından,Çevremi saran ölümcül düşmanlarımdan."));
trsuperobject.biblemap.put("b19_17_10", new trsuperobject(19,17,10,"Yürekleri yağ bağlamış,Ağızları büyük laflar ediyor."));
trsuperobject.biblemap.put("b19_17_11", new trsuperobject(19,17,11,"İzimi buldular, üzerime geliyorlar,Yere vurmak için gözetliyorlar."));
trsuperobject.biblemap.put("b19_17_12", new trsuperobject(19,17,12,"Tıpkı parçalamak için sabırsızlanan bir aslan,Pusuya yatan genç bir aslan gibi."));
trsuperobject.biblemap.put("b19_17_13", new trsuperobject(19,17,13,"Kalk, ya RAB, kes önlerini, eğ başlarını!Kılıcınla kurtar canımı kötülerden,"));
trsuperobject.biblemap.put("b19_17_14", new trsuperobject(19,17,14,"Elinle bu insanlardan, ya RAB,Yaşam payı bu dünyada olan insanlardan.Varsın karınları vereceğin cezalara doysun,Çocukları da yiyip doysun,Artanı torunlarına kalsın!"));
trsuperobject.biblemap.put("b19_17_15", new trsuperobject(19,17,15,"Ama ben doğruluk sayesinde yüzünü göreceğim senin,Uyanınca suretini görmeye doyacağım."));
trsuperobject.biblemap.put("b19_18_1", new trsuperobject(19,18,1,"Seni seviyorum, gücüm sensin, ya RAB!"));
trsuperobject.biblemap.put("b19_18_3", new trsuperobject(19,18,3,"Övgüye değer RABbe seslenir,Kurtulurum düşmanlarımdan."));
trsuperobject.biblemap.put("b19_18_4", new trsuperobject(19,18,4,"Ölüm iplerine dolanmıştım,Yıkım selleri basmıştı beni,"));
trsuperobject.biblemap.put("b19_18_5", new trsuperobject(19,18,5,"Ölüler diyarının bağları sarmıştı,Ölüm tuzakları çıkmıştı karşıma."));
trsuperobject.biblemap.put("b19_18_6", new trsuperobject(19,18,6,"Sıkıntı içinde RABbe yakardım,Yardıma çağırdım Tanrımı.Tapınağından sesimi duydu,Haykırışım kulaklarına ulaştı."));
trsuperobject.biblemap.put("b19_18_7", new trsuperobject(19,18,7,"O zaman yeryüzü sarsılıp sallandı,Titreyip sarsıldı dağların temelleri,Çünkü RAB öfkelenmişti."));
trsuperobject.biblemap.put("b19_18_8", new trsuperobject(19,18,8,"Burnundan duman yükseldi,Ağzından kavurucu ateşVe korlar fışkırdı."));
trsuperobject.biblemap.put("b19_18_9", new trsuperobject(19,18,9,"Kara buluta basarakGökleri yarıp indi."));
trsuperobject.biblemap.put("b19_18_10", new trsuperobject(19,18,10,"Bir Keruva binip uçtu,Rüzgar kanatlar takarak hızla geldi."));
trsuperobject.biblemap.put("b19_18_11", new trsuperobject(19,18,11,"Karanlığı örtündü,Kara bulutları kendine çardak yaptı."));
trsuperobject.biblemap.put("b19_18_12", new trsuperobject(19,18,12,"Varlığının parıltısından,Bulutlardan dolu ve korlar savruluyordu."));
trsuperobject.biblemap.put("b19_18_13", new trsuperobject(19,18,13,"RAB göklerden gürledi,Duyurdu sesini Yüceler Yücesi,Dolu ve alevli korlarla."));
trsuperobject.biblemap.put("b19_18_14", new trsuperobject(19,18,14,"Savurup oklarını düşmanlarını dağıttı,Şimşek çaktırarak onları şaşkına çevirdi."));
trsuperobject.biblemap.put("b19_18_15", new trsuperobject(19,18,15,"Denizin dibi göründü,Yeryüzünün temelleri açığa çıktı, ya RAB,Senin azarlamandan,Burnundan çıkan güçlü soluktan."));
trsuperobject.biblemap.put("b19_18_16", new trsuperobject(19,18,16,"RAB yukarıdan elini uzatıp tuttu,Çıkardı beni derin sulardan."));
trsuperobject.biblemap.put("b19_18_17", new trsuperobject(19,18,17,"Beni zorlu düşmanımdan,Benden nefret edenlerden kurtardı,Çünkü onlar benden güçlüydü."));
trsuperobject.biblemap.put("b19_18_18", new trsuperobject(19,18,18,"Felaket günümde karşıma dikildiler,Ama RAB bana destek oldu."));
trsuperobject.biblemap.put("b19_18_19", new trsuperobject(19,18,19,"Beni huzura kavuşturdu,Kurtardı, çünkü benden hoşnut kaldı."));
trsuperobject.biblemap.put("b19_18_20", new trsuperobject(19,18,20,"RAB doğruluğumun karşılığını verdi,Beni temiz ellerime göre ödüllendirdi."));
trsuperobject.biblemap.put("b19_18_21", new trsuperobject(19,18,21,"Çünkü RABbin yolunda yürüdüm,Tanrımdan uzaklaşarak kötülük yapmadım."));
trsuperobject.biblemap.put("b19_18_22", new trsuperobject(19,18,22,"Onun bütün ilkelerini göz önünde tuttum,Kurallarından ayrılmadım."));
trsuperobject.biblemap.put("b19_18_23", new trsuperobject(19,18,23,"Onun gözünde kusursuzdum,Suç işlemekten sakındım."));
trsuperobject.biblemap.put("b19_18_24", new trsuperobject(19,18,24,"Bu yüzden RAB beni doğruluğumaVe gözünde pak olan ellerime göre ödüllendirdi."));
trsuperobject.biblemap.put("b19_18_25", new trsuperobject(19,18,25,"Sadık kuluna sadakat gösterir,Kusursuz olana kusursuz davranırsın."));
trsuperobject.biblemap.put("b19_18_26", new trsuperobject(19,18,26,"Pak olanla pak olur,Eğriye eğri davranırsın."));
trsuperobject.biblemap.put("b19_18_27", new trsuperobject(19,18,27,"Alçakgönüllüleri kurtarır,Gururluların başını eğersin."));
trsuperobject.biblemap.put("b19_18_28", new trsuperobject(19,18,28,"Işığımın kaynağı sensin, ya RAB, Tanrım!Karanlığımı aydınlatırsın."));
trsuperobject.biblemap.put("b19_18_29", new trsuperobject(19,18,29,"Desteğinle akıncılara saldırır,Seninle surları aşarım, Tanrım."));
trsuperobject.biblemap.put("b19_18_30", new trsuperobject(19,18,30,"Tanrının yolu kusursuzdur,RABbin sözü arıdır.O kendisine sığınan herkesin kalkanıdır."));
trsuperobject.biblemap.put("b19_18_31", new trsuperobject(19,18,31,"Var mı RABden başka tanrı?Tanrımızdan başka kaya var mı?"));
trsuperobject.biblemap.put("b19_18_32", new trsuperobject(19,18,32,"Tanrı beni güçle donatır,Yolumu kusursuz kılar."));
trsuperobject.biblemap.put("b19_18_33", new trsuperobject(19,18,33,"Ayaklar verdi bana, geyiklerinki gibi,Doruklarda tutar beni."));
trsuperobject.biblemap.put("b19_18_34", new trsuperobject(19,18,34,"Bana savaşmayı öğretti,Kollarımla tunç bir yayı gereyim diye."));
trsuperobject.biblemap.put("b19_18_35", new trsuperobject(19,18,35,"Bana zafer kalkanını bağışlarsın,Sağ elin destekler,Alçakgönüllülüğün yüceltir beni."));
trsuperobject.biblemap.put("b19_18_36", new trsuperobject(19,18,36,"Bastığım yerleri genişletirsin,Burkulmaz bileklerim."));
trsuperobject.biblemap.put("b19_18_37", new trsuperobject(19,18,37,"Kovalayıp yetiştim düşmanlarıma,Hepsi yok olmadan geri dönmedim."));
trsuperobject.biblemap.put("b19_18_38", new trsuperobject(19,18,38,"Ezdim onları, kalkamaz oldular,Ayaklarımın altına serildiler."));
trsuperobject.biblemap.put("b19_18_39", new trsuperobject(19,18,39,"Savaş için beni güçle donattın,Bana başkaldıranları önümde yere serdin."));
trsuperobject.biblemap.put("b19_18_40", new trsuperobject(19,18,40,"Düşmanlarımı kaçmak zorunda bıraktın,Benden nefret edenleri yok ettim."));
trsuperobject.biblemap.put("b19_18_41", new trsuperobject(19,18,41,"Feryat ettiler, ama kurtaran çıkmadı;RABbi çağırdılar, ama O yanıt vermedi."));
trsuperobject.biblemap.put("b19_18_42", new trsuperobject(19,18,42,"Ezdim onları, rüzgarın savurduğu toza döndüler,Sokak çamuru gibi savurup attım."));
trsuperobject.biblemap.put("b19_18_43", new trsuperobject(19,18,43,"Halkımın çekişmelerinden beni kurtardın,Ulusların önderi yaptın,Tanımadığım halklar bana kulluk ediyor."));
trsuperobject.biblemap.put("b19_18_44", new trsuperobject(19,18,44,"Duyar duymaz sözümü dinlediler,Yabancılar bana yaltaklandılar."));
trsuperobject.biblemap.put("b19_18_45", new trsuperobject(19,18,45,"Yabancıların betleri benizleri attı,Titreyerek çıktılar kalelerinden."));
trsuperobject.biblemap.put("b19_18_46", new trsuperobject(19,18,46,"RAB yaşıyor! Kayama övgüler olsun!Yücelsin kurtarıcım Tanrı!"));
trsuperobject.biblemap.put("b19_18_47", new trsuperobject(19,18,47,"Odur öcümü alan,Halkları bana bağımlı kılan."));
trsuperobject.biblemap.put("b19_18_48", new trsuperobject(19,18,48,"Düşmanlarımdan kurtarır,Başkaldıranlardan üstün kılar beni,Zorbaların elinden alır."));
trsuperobject.biblemap.put("b19_18_49", new trsuperobject(19,18,49,"Bunun için uluslar arasında sana şükredeceğim, ya RAB,Adını ilahilerle öveceğim."));
trsuperobject.biblemap.put("b19_18_50", new trsuperobject(19,18,50,"RAB kralını büyük zaferlere ulaştırır,Meshettiği krala, Davut'a ve soyunaSonsuza dek sevgi gösterir."));
trsuperobject.biblemap.put("b19_19_1", new trsuperobject(19,19,1,"Gökler Tanrının görkemini açıklamakta,Gökkubbe ellerinin eserini duyurmakta."));
trsuperobject.biblemap.put("b19_19_2", new trsuperobject(19,19,2,"Gün güne söz söyler,Gece geceye bilgi verir."));
trsuperobject.biblemap.put("b19_19_3", new trsuperobject(19,19,3,"Ne söz geçer orada, ne de konuşma,Sesleri duyulmaz."));
trsuperobject.biblemap.put("b19_19_4", new trsuperobject(19,19,4,"Ama sesleri yeryüzünü dolaşır,Sözleri dünyanın dört bucağına ulaşır.  Güneş için göklerde çadır kurdu Tanrı."));
trsuperobject.biblemap.put("b19_19_5", new trsuperobject(19,19,5,"Gerdekten çıkan güveye benzer güneş,Koşuya çıkacak atlet gibi sevinir."));
trsuperobject.biblemap.put("b19_19_6", new trsuperobject(19,19,6,"Göğün bir ucundan çıkar,Öbür ucuna döner,Hiçbir şey gizlenmez sıcaklığından."));
trsuperobject.biblemap.put("b19_19_10", new trsuperobject(19,19,10,"Onlara altından, bol miktarda saf altından çok istek duyulur,Onlar baldan, süzme petek balından tatlıdır."));
trsuperobject.biblemap.put("b19_19_11", new trsuperobject(19,19,11,"Uyarırlar kulunu,Onlara uyanların ödülü büyüktür."));
trsuperobject.biblemap.put("b19_19_12", new trsuperobject(19,19,12,"Kim yanlışlarını görebilir?Bağışla göremediğim kusurlarımı,"));
trsuperobject.biblemap.put("b19_19_13", new trsuperobject(19,19,13,"Bilerek işlenen günahlardan koru kulunu,İzin verme bana egemen olmalarına!O zaman büyük isyandan uzak,Kusursuz olurum."));
trsuperobject.biblemap.put("b19_19_14", new trsuperobject(19,19,14,"Ağzımdan çıkan sözler,Yüreğimdeki düşünceler,Kabul görsün senin önünde,Ya RAB, kayam, kurtarıcım benim! ‹‹Goel›› sözcüğü ‹‹Yakın akraba›› anlamına gelir (bkz. Rut 2:20)."));
trsuperobject.biblemap.put("b19_20_1", new trsuperobject(19,20,1,"Sıkıntılı gününde RAB seni yanıtlasın,Yakupun Tanrısının adı seni korusun!"));
trsuperobject.biblemap.put("b19_20_2", new trsuperobject(19,20,2,"Yardım göndersin sana kutsal yerden,Siyondan destek versin."));
trsuperobject.biblemap.put("b19_20_3", new trsuperobject(19,20,3,"Bütün tahıl sunularını anımsasın,Yakmalık sunularını kabul etsin! Sela"));
trsuperobject.biblemap.put("b19_20_4", new trsuperobject(19,20,4,"Gönlünce versin sana,Bütün tasarılarını gerçekleştirsin!"));
trsuperobject.biblemap.put("b19_20_5", new trsuperobject(19,20,5,"O zaman zaferini sevinç çığlıklarıyla kutlayacağız,Tanrımızın adıyla sancaklarımızı dikeceğiz.RAB senin bütün dileklerini yerine getirsin."));
trsuperobject.biblemap.put("b19_20_6", new trsuperobject(19,20,6,"Şimdi anladım ki, RAB meshettiği kralı kurtarıyor,Sağ elinin kurtarıcı gücüyleKutsal göklerinden ona yanıt veriyor."));
trsuperobject.biblemap.put("b19_20_7", new trsuperobject(19,20,7,"Bazıları savaş arabalarına,Bazıları atlarına güvenir,Bizse Tanrımız RABbin adına güveniriz."));
trsuperobject.biblemap.put("b19_20_8", new trsuperobject(19,20,8,"Onlar çöküyor, düşüyorlar;Bizse kalkıyor, dimdik duruyoruz."));
trsuperobject.biblemap.put("b19_20_9", new trsuperobject(19,20,9,"Ya RAB, kralı kurtar!Yanıtla bizi sana yakardığımız gün!"));
trsuperobject.biblemap.put("b19_21_1", new trsuperobject(19,21,1,"Ya RAB, kral seviniyor gösterdiğin güce.Sevinçten coşuyor verdiğin zaferle!"));
trsuperobject.biblemap.put("b19_21_2", new trsuperobject(19,21,2,"Gönlünün istediğini verdin,Ağzından çıkan dileği geri çevirmedin. Sela"));
trsuperobject.biblemap.put("b19_21_3", new trsuperobject(19,21,3,"Onu güzel armağanlarla karşıladın,Başına saf altından taç koydun."));
trsuperobject.biblemap.put("b19_21_4", new trsuperobject(19,21,4,"Senden yaşam istedi, verdin ona:Uzun, sonsuz bir ömür."));
trsuperobject.biblemap.put("b19_21_5", new trsuperobject(19,21,5,"Sağladığın zaferle büyük yüceliğe erişti,Onu görkem ve büyüklükle donattın."));
trsuperobject.biblemap.put("b19_21_6", new trsuperobject(19,21,6,"Üzerine sürekli bereket yağdırdın,Varlığınla onu sevince boğdun."));
trsuperobject.biblemap.put("b19_21_7", new trsuperobject(19,21,7,"Çünkü kral RABbe güvenir,Yüceler Yücesinin sevgisi sayesinde sarsılmaz."));
trsuperobject.biblemap.put("b19_21_8", new trsuperobject(19,21,8,"Elin bütün düşmanlarına erişecek,Sağ elin senden nefret edenlere uzanacak."));
trsuperobject.biblemap.put("b19_21_9", new trsuperobject(19,21,9,"Öfkelendiğin an, ya RAB,Kızgın fırına döndüreceksin onları;Gazapla yutacak,Ateşle tüketeceksin."));
trsuperobject.biblemap.put("b19_21_10", new trsuperobject(19,21,10,"Yok edeceksin çocuklarını yeryüzünden,Soylarını insanlar arasından."));
trsuperobject.biblemap.put("b19_21_11", new trsuperobject(19,21,11,"Düzenler kursalar sana,Aldatmaya çalışsalar,Yine de başarılı olamazlar."));
trsuperobject.biblemap.put("b19_21_12", new trsuperobject(19,21,12,"Çünkü sırtlarını döndüreceksin,Yayını yüzlerine doğru gerince."));
trsuperobject.biblemap.put("b19_21_13", new trsuperobject(19,21,13,"Yüceliğini göster, ya RAB, gücünle!Ezgiler söyleyip ilahilerle öveceğiz kudretini."));
trsuperobject.biblemap.put("b19_22_1", new trsuperobject(19,22,1,"Tanrım, Tanrım, beni neden terk ettin?Niçin bana yardım etmekten,Haykırışıma kulak vermekten uzak duruyorsun?"));
trsuperobject.biblemap.put("b19_22_2", new trsuperobject(19,22,2,"Ey Tanrım, gündüz sesleniyorum, yanıt vermiyorsun,Gece sesleniyorum, yine rahat yok bana."));
trsuperobject.biblemap.put("b19_22_3", new trsuperobject(19,22,3,"Oysa sen kutsalsın,İsrailin övgüleri üzerine taht kuran sensin."));
trsuperobject.biblemap.put("b19_22_4", new trsuperobject(19,22,4,"Sana güvendiler atalarımız,Sana dayandılar, onları kurtardın."));
trsuperobject.biblemap.put("b19_22_5", new trsuperobject(19,22,5,"Sana yakarıp kurtuldular,Sana güvendiler, aldanmadılar."));
trsuperobject.biblemap.put("b19_22_6", new trsuperobject(19,22,6,"Ama ben insan değil, toprak kurduyum,İnsanlar beni küçümsüyor, halk hor görüyor."));
trsuperobject.biblemap.put("b19_22_7", new trsuperobject(19,22,7,"Beni gören herkes alay ediyor,Sırıtıp baş sallayarak diyorlar ki,"));
trsuperobject.biblemap.put("b19_22_8", new trsuperobject(19,22,8,"‹‹Sırtını RABbe dayadı, kurtarsın bakalım onu,Madem onu seviyor, yardım etsin!››"));
trsuperobject.biblemap.put("b19_22_9", new trsuperobject(19,22,9,"Oysa beni ana rahminden çıkaran,Ana kucağındayken sana güvenmeyi öğreten sensin."));
trsuperobject.biblemap.put("b19_22_10", new trsuperobject(19,22,10,"Doğuşumdan beri sana teslim edildim,Ana rahminden beri Tanrım sensin."));
trsuperobject.biblemap.put("b19_22_11", new trsuperobject(19,22,11,"Benden uzak durma! Çünkü sıkıntı yanıbaşımda,Yardım edecek kimse yok."));
trsuperobject.biblemap.put("b19_22_12", new trsuperobject(19,22,12,"Boğalar kuşatıyor beni,Azgın Başan boğaları sarıyor çevremi."));
trsuperobject.biblemap.put("b19_22_13", new trsuperobject(19,22,13,"Kükreyerek avını parçalayan aslanlar gibiAğızlarını açıyorlar bana."));
trsuperobject.biblemap.put("b19_22_14", new trsuperobject(19,22,14,"Su gibi dökülüyorum,Bütün kemiklerim oynaklarından çıkıyor;Yüreğim balmumu gibi içimde eriyor."));
trsuperobject.biblemap.put("b19_22_15", new trsuperobject(19,22,15,"Gücüm çömlek parçası gibi kurudu,Dilim damağıma yapışıyor;Beni ölüm toprağına yatırdın."));
trsuperobject.biblemap.put("b19_22_16", new trsuperobject(19,22,16,"Köpekler kuşatıyor beni,Kötüler sürüsü çevremi sarıyor,Ellerimi, ayaklarımı deliyorlar."));
trsuperobject.biblemap.put("b19_22_17", new trsuperobject(19,22,17,"Bütün kemiklerimi sayar oldum,Gözlerini dikmiş, bana bakıyorlar."));
trsuperobject.biblemap.put("b19_22_18", new trsuperobject(19,22,18,"Giysilerimi aralarında paylaşıyor,Elbisem için kura çekiyorlar."));
trsuperobject.biblemap.put("b19_22_19", new trsuperobject(19,22,19,"Ama sen, ya RAB, uzak durma;Ey gücüm benim, yardımıma koş!"));
trsuperobject.biblemap.put("b19_22_20", new trsuperobject(19,22,20,"Canımı kılıçtan,Biricik hayatımı köpeğin pençesinden kurtar!"));
trsuperobject.biblemap.put("b19_22_21", new trsuperobject(19,22,21,"Kurtar beni aslanın ağzından,Yaban öküzlerinin boynuzundan.Yanıt ver bana!"));
trsuperobject.biblemap.put("b19_22_22", new trsuperobject(19,22,22,"Adını kardeşlerime duyurayım,Topluluğun ortasında sana övgüler sunayım:"));
trsuperobject.biblemap.put("b19_22_23", new trsuperobject(19,22,23,"Ey sizler, RABden korkanlar, Ona övgüler sunun!Ey Yakup soyu, Onu yüceltin!Ey İsrail soyu, Ona saygı gösterin!"));
trsuperobject.biblemap.put("b19_22_24", new trsuperobject(19,22,24,"Çünkü O mazlumun çektiği sıkıntıyı hafife almadı,Ondan tiksinmedi, yüz çevirmedi;Kendisini yardıma çağırdığında ona kulak verdi."));
trsuperobject.biblemap.put("b19_22_25", new trsuperobject(19,22,25,"Övgü konum sen olacaksın büyük toplulukta,Senden korkanların önünde yerine getireceğim adaklarımı."));
trsuperobject.biblemap.put("b19_22_26", new trsuperobject(19,22,26,"Yoksullar yiyip doyacak,RABbe yönelenler Ona övgü sunacak.Sonsuza dek ömrünüz tükenmesin!"));
trsuperobject.biblemap.put("b19_22_27", new trsuperobject(19,22,27,"Yeryüzünün dört bucağı anımsayıp RABbe dönecek,Ulusların bütün soyları Onun önünde yere kapanacak."));
trsuperobject.biblemap.put("b19_22_28", new trsuperobject(19,22,28,"Çünkü egemenlik RABbindir,Ulusları O yönetir."));
trsuperobject.biblemap.put("b19_22_29", new trsuperobject(19,22,29,"Yeryüzündeki bütün zenginler doyacakVe Onun önünde yere kapanacak,Toprağa gidenler,Ölümlerine engel olamayanlar,Eğilecekler Onun önünde."));
trsuperobject.biblemap.put("b19_22_30", new trsuperobject(19,22,30,"Gelecek kuşaklar Ona kulluk edecek,Rab yeni kuşaklara anlatılacak."));
trsuperobject.biblemap.put("b19_22_31", new trsuperobject(19,22,31,"O'nun kurtarışını,‹‹Rab yaptı bunları›› diyerek,Henüz doğmamış bir halka duyuracaklar."));
trsuperobject.biblemap.put("b19_23_2", new trsuperobject(19,23,2,"Beni yemyeşil çayırlarda yatırır,Sakin suların kıyısına götürür."));
trsuperobject.biblemap.put("b19_23_3", new trsuperobject(19,23,3,"İçimi tazeler,Adı uğruna bana doğru yollarda öncülük eder."));
trsuperobject.biblemap.put("b19_23_4", new trsuperobject(19,23,4,"Karanlık ölüm vadisinden geçsem bile,Kötülükten korkmam.Çünkü sen benimlesin.Çomağın, değneğin güven verir bana."));
trsuperobject.biblemap.put("b19_23_5", new trsuperobject(19,23,5,"Düşmanlarımın önünde bana sofra kurarsın,Başıma yağ sürersin,Kâsem taşıyor."));
trsuperobject.biblemap.put("b19_23_6", new trsuperobject(19,23,6,"Ömrüm boyunca yalnız iyilik ve sevgi izleyecek beni,Hep RAB'bin evinde oturacağım."));
trsuperobject.biblemap.put("b19_24_2", new trsuperobject(19,24,2,"Çünkü Odur denizler üzerinde onu kuran,Sular üzerinde durduran."));
trsuperobject.biblemap.put("b19_24_4", new trsuperobject(19,24,4,"Elleri pak, yüreği temiz olan,Gönlünü putlara kaptırmayan,Yalan yere ant içmeyen."));
trsuperobject.biblemap.put("b19_24_6", new trsuperobject(19,24,6,"Ona yönelenler,Yakupun Tanrısının yüzünü arayanlarİşte böyledir. Sela"));
trsuperobject.biblemap.put("b19_24_7", new trsuperobject(19,24,7,"Kaldırın başınızı, ey kapılar!Açılın, ey eski kapılar!Yüce Kral girsin içeri!"));
trsuperobject.biblemap.put("b19_24_8", new trsuperobject(19,24,8,"Kimdir bu Yüce Kral?O RABdir, güçlü ve yiğit,Savaşta yiğit olan RAB."));
trsuperobject.biblemap.put("b19_24_9", new trsuperobject(19,24,9,"Kaldırın başınızı, ey kapılar!Açılın, ey eski kapılar!Yüce Kral girsin içeri!"));
trsuperobject.biblemap.put("b19_24_10", new trsuperobject(19,24,10,"Kimdir bu Yüce Kral?Her Şeye EgemenRAB'dir bu Yüce Kral! Sela"));
trsuperobject.biblemap.put("b19_25_1", new trsuperobject(19,25,1,"Ya RAB, bütün varlığımla sana yaklaşıyorum,"));
trsuperobject.biblemap.put("b19_25_2", new trsuperobject(19,25,2,"Ey Tanrım, sana güveniyorum, utandırma beni,Düşmanlarım zafer kahkahası atmasın!"));
trsuperobject.biblemap.put("b19_25_3", new trsuperobject(19,25,3,"Sana umut bağlayan hiç kimse utanca düşmez;Nedensiz hainlik edenler utanır."));
trsuperobject.biblemap.put("b19_25_4", new trsuperobject(19,25,4,"Ya RAB, yollarını bana öğret,Yönlerini bildir."));
trsuperobject.biblemap.put("b19_25_5", new trsuperobject(19,25,5,"Bana gerçek yolunda öncülük et, eğit beni;Çünkü beni kurtaran Tanrı sensin.Bütün gün umudum sende."));
trsuperobject.biblemap.put("b19_25_6", new trsuperobject(19,25,6,"Ya RAB, sevecenliğini ve sevgini anımsa;Çünkü onlar öncesizlikten beri aynıdır."));
trsuperobject.biblemap.put("b19_25_7", new trsuperobject(19,25,7,"Gençlik günahlarımı, isyanlarımı anımsama,Sevgine göre anımsa beni,Çünkü sen iyisin, ya RAB."));
trsuperobject.biblemap.put("b19_25_9", new trsuperobject(19,25,9,"Alçakgönüllülere adalet yolunda öncülük eder,Kendi yolunu öğretir onlara."));
trsuperobject.biblemap.put("b19_25_10", new trsuperobject(19,25,10,"RABbin bütün yolları sevgi ve sadakate dayanırAntlaşmasındaki buyruklara uyanlar için."));
trsuperobject.biblemap.put("b19_25_11", new trsuperobject(19,25,11,"Ya RAB, adın uğrunaSuçumu bağışla, çünkü suçum büyük."));
trsuperobject.biblemap.put("b19_25_12", new trsuperobject(19,25,12,"Kim RABden korkarsa,RAB ona seçeceği yolu gösterir."));
trsuperobject.biblemap.put("b19_25_13", new trsuperobject(19,25,13,"Gönenç içinde yaşayacak o insan,Soyu ülkeyi sahiplenecek."));
trsuperobject.biblemap.put("b19_25_14", new trsuperobject(19,25,14,"RAB kendisinden korkanlarla paylaşır sırrını,Onlara açıklar antlaşmasını."));
trsuperobject.biblemap.put("b19_25_15", new trsuperobject(19,25,15,"Gözlerim hep RABdedir,Çünkü ayaklarımı ağdan O çıkarır."));
trsuperobject.biblemap.put("b19_25_16", new trsuperobject(19,25,16,"Halime bak, lütfet bana;Çünkü garip ve mazlumum."));
trsuperobject.biblemap.put("b19_25_17", new trsuperobject(19,25,17,"Yüreğimdeki sıkıntılar artıyor,Kurtar beni dertlerimden!"));
trsuperobject.biblemap.put("b19_25_18", new trsuperobject(19,25,18,"Üzüntüme, acılarıma bak,Bütün günahlarımı bağışla!"));
trsuperobject.biblemap.put("b19_25_19", new trsuperobject(19,25,19,"Düşmanlarıma bak, ne kadar çoğaldılar,Nasıl da benden nefret ediyorlar!"));
trsuperobject.biblemap.put("b19_25_20", new trsuperobject(19,25,20,"Canımı koru, kurtar beni!Hayal kırıklığına uğratma, çünkü sana sığınıyorum!"));
trsuperobject.biblemap.put("b19_25_21", new trsuperobject(19,25,21,"Dürüstlük, doğruluk korusun beni,Çünkü umudum sendedir."));
trsuperobject.biblemap.put("b19_25_22", new trsuperobject(19,25,22,"Ey Tanrı, kurtar İsrail'iBütün sıkıntılarından!"));
trsuperobject.biblemap.put("b19_26_1", new trsuperobject(19,26,1,"Beni haklı çıkar, ya RAB,Çünkü dürüst bir yaşam sürdüm;Sarsılmadan RABbe güvendim."));
trsuperobject.biblemap.put("b19_26_2", new trsuperobject(19,26,2,"Dene beni, ya RAB, sına;Duygularımı, düşüncelerimi yokla."));
trsuperobject.biblemap.put("b19_26_3", new trsuperobject(19,26,3,"Çünkü sevgini hep göz önünde tutuyor,Senin gerçeğini yaşıyorum ben."));
trsuperobject.biblemap.put("b19_26_4", new trsuperobject(19,26,4,"Yalancılarla oturmam,İkiyüzlülerin suyuna gitmem."));
trsuperobject.biblemap.put("b19_26_5", new trsuperobject(19,26,5,"Kötülük yapanlar topluluğundan nefret ederim,Fesatçıların arasına girmem."));
trsuperobject.biblemap.put("b19_26_6", new trsuperobject(19,26,6,"Suçsuzluğumu göstermek için ellerimi yıkar,Sunağının çevresinde dönerim, ya RAB,"));
trsuperobject.biblemap.put("b19_26_7", new trsuperobject(19,26,7,"Yüksek sesle şükranımı duyurmakVe bütün harikalarını anlatmak için."));
trsuperobject.biblemap.put("b19_26_8", new trsuperobject(19,26,8,"Severim, ya RAB, yaşadığın evi,Görkeminin bulunduğu yeri."));
trsuperobject.biblemap.put("b19_26_9", new trsuperobject(19,26,9,"Günahkârların,Eli kanlı adamların yanısıra canımı alma."));
trsuperobject.biblemap.put("b19_26_10", new trsuperobject(19,26,10,"Onların elleri kötülük aletidir,Sağ elleri rüşvet doludur."));
trsuperobject.biblemap.put("b19_26_11", new trsuperobject(19,26,11,"Ama ben dürüst yaşarım,Kurtar beni, lütfet bana!"));
trsuperobject.biblemap.put("b19_26_12", new trsuperobject(19,26,12,"Ayağım emin yerde duruyor.Topluluk içinde sana övgüler sunacağım, ya RAB."));
trsuperobject.biblemap.put("b19_27_2", new trsuperobject(19,27,2,"Hasımlarım, düşmanlarım olan kötüler,Beni yutmak için üzerime gelirkenTökezleyip düşerler."));
trsuperobject.biblemap.put("b19_27_3", new trsuperobject(19,27,3,"Karşımda bir ordu konaklasa,Kılım kıpırdamaz,Bana karşı savaş açılsa,Yine güvenimi yitirmem."));
trsuperobject.biblemap.put("b19_27_5", new trsuperobject(19,27,5,"Çünkü O kötü günde beni çardağında gizleyecek,Çadırının emin yerinde saklayacak,Yüksek bir kaya üzerine çıkaracak beni."));
trsuperobject.biblemap.put("b19_27_6", new trsuperobject(19,27,6,"O zaman çevremi saran düşmanlarıma karşıBaşım yukarı kalkacak,Sevinçle haykırarak kurbanlar sunacağım Onun çadırında,Onu ezgilerle, ilahilerle öveceğim."));
trsuperobject.biblemap.put("b19_27_7", new trsuperobject(19,27,7,"Sana yakarıyorum, ya RAB, kulak ver sesime,Lütfet, yanıtla beni!"));
trsuperobject.biblemap.put("b19_27_8", new trsuperobject(19,27,8,"Ya RAB, içimden bir ses duydum:‹‹Yüzümü ara!›› dedin,İşte yüzünü arıyorum."));
trsuperobject.biblemap.put("b19_27_9", new trsuperobject(19,27,9,"Yüzünü benden gizleme,Kulunu öfkeyle geri çevirme!Bana hep yardımcı oldun;Bırakma, terk etme beni,Ey beni kurtaran Tanrı!"));
trsuperobject.biblemap.put("b19_27_10", new trsuperobject(19,27,10,"Annemle babam beni terk etseler bile,RAB beni kabul eder."));
trsuperobject.biblemap.put("b19_27_11", new trsuperobject(19,27,11,"Ya RAB, yolunu öğret bana,Düşmanlarıma karşıDüz yolda bana öncülük et."));
trsuperobject.biblemap.put("b19_27_12", new trsuperobject(19,27,12,"Beni hasımlarımın keyfine bırakma,Çünkü yalancı tanıklar dikiliyor karşıma,Ağızları şiddet saçıyor."));
trsuperobject.biblemap.put("b19_27_13", new trsuperobject(19,27,13,"Yaşam diyarındaRABbin iyiliğini göreceğimden kuşkum yok."));
trsuperobject.biblemap.put("b19_27_14", new trsuperobject(19,27,14,"Umudunu RAB'be bağla,Güçlü ve yürekli ol;Umudunu RAB'be bağla!"));
trsuperobject.biblemap.put("b19_28_1", new trsuperobject(19,28,1,"Ya RAB, sana yakarıyorum,Kayam benim, kulak tıkama sesime;Çünkü sen sessiz kalırsan,Ölüm çukuruna inen ölülere dönerim ben."));
trsuperobject.biblemap.put("b19_28_2", new trsuperobject(19,28,2,"Seni yardıma çağırdığımda,Ellerimi kutsal konutuna doğru açtığımda,Kulak ver yalvarışlarıma."));
trsuperobject.biblemap.put("b19_28_3", new trsuperobject(19,28,3,"Beni kötülerle, haksızlık yapanlarlaAynı kefeye koyup cezalandırma.Onlar komşularıyla dostça konuşur,Ama yüreklerinde kötülük beslerler."));
trsuperobject.biblemap.put("b19_28_4", new trsuperobject(19,28,4,"Eylemlerine, yaptıkları kötülüklere göre onları yanıtla;Yaptıklarının, hak ettiklerinin karşılığını ver."));
trsuperobject.biblemap.put("b19_28_5", new trsuperobject(19,28,5,"Onlar RABbin yaptıklarına,Ellerinin eserine önem vermezler;Bu yüzden RAB onları yıkacak,Bir daha ayağa kaldırmayacak."));
trsuperobject.biblemap.put("b19_28_9", new trsuperobject(19,28,9,"Halkını kurtar, kendi halkını kutsa;Çobanlık et onlara, sürekli destek ol!"));
trsuperobject.biblemap.put("b19_29_1", new trsuperobject(19,29,1,"Ey ilahi varlıklar, RABbi övün,RABbin gücünü, yüceliğini övün,"));
trsuperobject.biblemap.put("b19_29_6", new trsuperobject(19,29,6,"Lübnanı buzağı gibi,Siryon Dağını yabanıl öküz yavrusu gibi sıçratır."));
trsuperobject.biblemap.put("b19_29_10", new trsuperobject(19,29,10,"RAB tufan üstünde taht kurdu,O sonsuza dek kral kalacak."));
trsuperobject.biblemap.put("b19_29_11", new trsuperobject(19,29,11,"RAB halkına güç verir,Halkını esenlikle kutsar!"));
trsuperobject.biblemap.put("b19_30_1", new trsuperobject(19,30,1,"Seni yüceltmek istiyorum, ya RAB,Çünkü beni kurtardın,Düşmanlarımı bana güldürmedin."));
trsuperobject.biblemap.put("b19_30_2", new trsuperobject(19,30,2,"Ya RAB Tanrım,Sana yakardım, bana şifa verdin."));
trsuperobject.biblemap.put("b19_30_3", new trsuperobject(19,30,3,"Ya RAB, beni ölüler diyarından çıkardın,Yaşam verdin bana, ölüm çukuruna düşürmedin."));
trsuperobject.biblemap.put("b19_30_4", new trsuperobject(19,30,4,"Ey RABbin sadık kulları, Onu ilahilerle övün,Kutsallığını anarak Ona şükredin."));
trsuperobject.biblemap.put("b19_30_5", new trsuperobject(19,30,5,"Çünkü öfkesi bir an sürer,Lütfu ise bir ömür;Gözyaşlarınız belki bir gece akar,Ama sabahla sevinç doğar."));
trsuperobject.biblemap.put("b19_30_6", new trsuperobject(19,30,6,"Huzur duyunca dedim ki,‹‹Asla sarsılmayacağım!››"));
trsuperobject.biblemap.put("b19_30_7", new trsuperobject(19,30,7,"Ya RAB, lütfunla beni güçlü bir dağ gibiSarsılmaz kıldın;Ama sen yüzünü gizleyince,Dehşete düştüm."));
trsuperobject.biblemap.put("b19_30_8", new trsuperobject(19,30,8,"Ya RAB, sana sesleniyorum,Rabbe yalvarıyorum:"));
trsuperobject.biblemap.put("b19_30_9", new trsuperobject(19,30,9,"‹‹Ne yararı olur senin için dökülen kanımın,Ölüm çukuruna inersem?Toprak sana övgüler sunar mı,Senin sadakatini ilan eder mi?"));
trsuperobject.biblemap.put("b19_30_10", new trsuperobject(19,30,10,"Dinle, ya RAB, acı bana;Yardımcım ol, ya RAB!››"));
trsuperobject.biblemap.put("b19_30_11", new trsuperobject(19,30,11,"Yasımı şenliğe döndürdün,Çulumu çıkarıp beni sevinçle kuşattın."));
trsuperobject.biblemap.put("b19_30_12", new trsuperobject(19,30,12,"Öyle ki, gönlüm seni ilahilerle övsün, susmasın!Ya RAB Tanrım, sana sürekli şükredeceğim."));
trsuperobject.biblemap.put("b19_31_1", new trsuperobject(19,31,1,"Ya RAB, sana sığınıyorum.Utandırma beni hiçbir zaman!Adaletinle kurtar beni!"));
trsuperobject.biblemap.put("b19_31_2", new trsuperobject(19,31,2,"Kulak ver bana,Çabuk yetiş, kurtar beni;Bir kaya ol bana sığınmam için,Güçlü bir kale ol kurtulmam için!"));
trsuperobject.biblemap.put("b19_31_3", new trsuperobject(19,31,3,"Madem kayam ve kalem sensin,Öncülük et, yol göster banaKendi adın uğruna."));
trsuperobject.biblemap.put("b19_31_4", new trsuperobject(19,31,4,"Bana kurdukları tuzaktan uzak tut beni,Çünkü sığınağım sensin."));
trsuperobject.biblemap.put("b19_31_5", new trsuperobject(19,31,5,"Ruhumu ellerine bırakıyorum,Ya RAB, sadık Tanrı, kurtar beni."));
trsuperobject.biblemap.put("b19_31_6", new trsuperobject(19,31,6,"Değersiz putlara bel bağlayanlardan tiksinirim,RABbe güvenirim ben."));
trsuperobject.biblemap.put("b19_31_7", new trsuperobject(19,31,7,"Sadakatinden ötürü sevinip coşacağım,Çünkü düşkün halimi görüyor,Çektiğim sıkıntıları biliyorsun,"));
trsuperobject.biblemap.put("b19_31_8", new trsuperobject(19,31,8,"Beni düşman eline düşürmedin,Bastığım yerleri genişlettin."));
trsuperobject.biblemap.put("b19_31_9", new trsuperobject(19,31,9,"Acı bana, ya RAB, sıkıntıdayım,Üzüntü gözümü, canımı, içimi kemiriyor."));
trsuperobject.biblemap.put("b19_31_10", new trsuperobject(19,31,10,"Ömrüm acıyla,Yıllarım iniltiyle tükeniyor,Suçumdan ötürü gücüm zayıflıyor,Kemiklerim eriyor."));
trsuperobject.biblemap.put("b19_31_11", new trsuperobject(19,31,11,"Düşmanlarım yüzünden rezil oldum,Özellikle komşularıma.Tanıdıklarıma dehşet salar oldum;Beni sokakta görenler benden kaçar oldu."));
trsuperobject.biblemap.put("b19_31_12", new trsuperobject(19,31,12,"Gönülden çıkmış bir ölü gibi unutuldum,Kırılmış bir çömleğe döndüm."));
trsuperobject.biblemap.put("b19_31_13", new trsuperobject(19,31,13,"Birçoğunun fısıldaştığını duyuyorum,Her yer dehşet içinde,Bana karşı anlaştılar,Canımı almak için düzen kurdular."));
trsuperobject.biblemap.put("b19_31_14", new trsuperobject(19,31,14,"Ama ben sana güveniyorum, ya RAB,‹‹Tanrım sensin!›› diyorum."));
trsuperobject.biblemap.put("b19_31_15", new trsuperobject(19,31,15,"Hayatım senin elinde,Kurtar beni düşmanlarımın pençesinden,Ardıma düşenlerden."));
trsuperobject.biblemap.put("b19_31_16", new trsuperobject(19,31,16,"Yüzün kulunu aydınlatsın,Sevgi göster, kurtar beni!"));
trsuperobject.biblemap.put("b19_31_17", new trsuperobject(19,31,17,"Utandırma beni, ya RAB, sana sesleniyorum;Kötüler utansın, ölüler diyarında sesleri kesilsin."));
trsuperobject.biblemap.put("b19_31_18", new trsuperobject(19,31,18,"Sussun o yalancı dudaklar;Doğru insana karşıGururla, tepeden bakarak,Küçümseyerek konuşan dudaklar."));
trsuperobject.biblemap.put("b19_31_19", new trsuperobject(19,31,19,"İyiliğin ne büyüktür, ya RAB,Onu senden korkanlar için saklarsın,Herkesin gözü önünde,Sana sığınanlara iyi davranırsın."));
trsuperobject.biblemap.put("b19_31_20", new trsuperobject(19,31,20,"İnsanların düzenlerine karşı,Koruyucu huzurunla üzerlerine kanat gerersin;Saldırgan dillere karşıOnları çardağında gizlersin."));
trsuperobject.biblemap.put("b19_31_21", new trsuperobject(19,31,21,"RABbe övgüler olsun,Kuşatılmış bir kentteSevgisini bana harika biçimde gösterdi."));
trsuperobject.biblemap.put("b19_31_22", new trsuperobject(19,31,22,"Telaş içinde demiştim ki,‹‹Huzurundan atıldım!››Ama yardıma çağırınca seni,Yalvarışımı işittin."));
trsuperobject.biblemap.put("b19_31_23", new trsuperobject(19,31,23,"RABbi sevin, ey Onun sadık kulları!RAB kendisine bağlı olanları korur,Büyüklenenlerin ise tümüyle hakkından gelir."));
trsuperobject.biblemap.put("b19_31_24", new trsuperobject(19,31,24,"Ey RAB'be umut bağlayanlar,Güçlü ve yürekli olun!"));
trsuperobject.biblemap.put("b19_32_1", new trsuperobject(19,32,1,"Ne mutlu isyanı bağışlanan,Günahı örtülen insana! edebiyat terimi. ‹‹Didaktik şiir›› anlamına gelebilir."));
trsuperobject.biblemap.put("b19_32_2", new trsuperobject(19,32,2,"Suçu RAB tarafından sayılmayan,Ruhunda hile bulunmayan insana ne mutlu!"));
trsuperobject.biblemap.put("b19_32_3", new trsuperobject(19,32,3,"Sustuğum süreceKemiklerim eridi,Gün boyu inlemekten."));
trsuperobject.biblemap.put("b19_32_4", new trsuperobject(19,32,4,"Çünkü gece gündüzElin üzerimde ağırlaştı.Dermanım tükendi yaz sıcağında gibi. Sela"));
trsuperobject.biblemap.put("b19_32_5", new trsuperobject(19,32,5,"Günahımı açıkladım sana,Suçumu gizlemedim.‹‹RABbe isyanımı itiraf edeceğim›› deyince,Günahımı, suçumu bağışladın. Sela"));
trsuperobject.biblemap.put("b19_32_6", new trsuperobject(19,32,6,"Bu nedenle her sadık kulunUlaşılır olduğun zaman sana dua etsin.Engin sular taşsa bile ona erişemez."));
trsuperobject.biblemap.put("b19_32_7", new trsuperobject(19,32,7,"Sığınağım sensin,Beni sıkıntıdan korur,Çevremi kurtuluş ilahileriyle kuşatırsın. Sela"));
trsuperobject.biblemap.put("b19_32_8", new trsuperobject(19,32,8,"Eğiteceğim seni, gideceğin yolu göstereceğim,Öğüt vereceğim sana,Gözüm sendedir."));
trsuperobject.biblemap.put("b19_32_9", new trsuperobject(19,32,9,"At ya da katır gibi anlayışsız olmayın;Onları idare etmek için gem ve dizgin gerekir,Yoksa sana yaklaşmazlar."));
trsuperobject.biblemap.put("b19_32_10", new trsuperobject(19,32,10,"Kötülerin acısı çoktur,Ama RABbe güvenenleri Onun sevgisi kuşatır."));
trsuperobject.biblemap.put("b19_32_11", new trsuperobject(19,32,11,"Ey doğru insanlar, sevinç kaynağınız RAB olsun, coşun;Ey yüreği temiz olanlar,Hepiniz sevinç çığlıkları atın!"));
trsuperobject.biblemap.put("b19_33_1", new trsuperobject(19,33,1,"Ey doğru insanlar, RABbe sevinçle haykırın!Dürüstlere Onu övmek yaraşır."));
trsuperobject.biblemap.put("b19_33_2", new trsuperobject(19,33,2,"Lir çalarak RABbe şükredin,On telli çenk eşliğinde Onu ilahilerle övün."));
trsuperobject.biblemap.put("b19_33_3", new trsuperobject(19,33,3,"Ona yeni bir ezgi söyleyin,Sevinç çığlıklarıyla sazınızı konuşturun."));
trsuperobject.biblemap.put("b19_33_4", new trsuperobject(19,33,4,"Çünkü RABbin sözü doğrudur,Her işi sadakatle yapar."));
trsuperobject.biblemap.put("b19_33_5", new trsuperobject(19,33,5,"Doğruluğu, adaleti sever,RABbin sevgisi yeryüzünü doldurur."));
trsuperobject.biblemap.put("b19_33_6", new trsuperobject(19,33,6,"Gökler RABbin sözüyle,Gök cisimleri ağzından çıkan solukla yaratıldı."));
trsuperobject.biblemap.put("b19_33_7", new trsuperobject(19,33,7,"Deniz sularını bir araya toplar,Engin suları ambarlara depolar."));
trsuperobject.biblemap.put("b19_33_8", new trsuperobject(19,33,8,"Bütün yeryüzü RABden korksun,Dünyada yaşayan herkes Ona saygı duysun."));
trsuperobject.biblemap.put("b19_33_9", new trsuperobject(19,33,9,"Çünkü O söyleyince, her şey var oldu;O buyurunca, her şey belirdi."));
trsuperobject.biblemap.put("b19_33_10", new trsuperobject(19,33,10,"RAB ulusların planlarını bozar,Halkların tasarılarını boşa çıkarır."));
trsuperobject.biblemap.put("b19_33_11", new trsuperobject(19,33,11,"Ama RABbin planları sonsuza dek sürer,Yüreğindeki tasarılar kuşaklar boyunca değişmez."));
trsuperobject.biblemap.put("b19_33_12", new trsuperobject(19,33,12,"Ne mutlu Tanrısı RAB olan ulusa,Kendisi için seçtiği halka!"));
trsuperobject.biblemap.put("b19_33_13", new trsuperobject(19,33,13,"RAB göklerden bakar,Bütün insanları görür."));
trsuperobject.biblemap.put("b19_33_14", new trsuperobject(19,33,14,"Oturduğu yerden,Yeryüzünde yaşayan herkesi gözler."));
trsuperobject.biblemap.put("b19_33_15", new trsuperobject(19,33,15,"Herkesin yüreğini yaratan,Yaptıkları her şeyi tartan Odur."));
trsuperobject.biblemap.put("b19_33_16", new trsuperobject(19,33,16,"Ne büyük ordularıyla zafer kazanan kral var,Ne de büyük gücüyle kurtulan yiğit."));
trsuperobject.biblemap.put("b19_33_17", new trsuperobject(19,33,17,"Zafer için at boş bir umuttur,Büyük gücüne karşın kimseyi kurtaramaz."));
trsuperobject.biblemap.put("b19_33_18", new trsuperobject(19,33,18,"Ama RABbin gözü kendisinden korkanların,Sevgisine umut bağlayanların üzerindedir;"));
trsuperobject.biblemap.put("b19_33_19", new trsuperobject(19,33,19,"Böylece onları ölümden kurtarır,Kıtlıkta yaşamalarını sağlar."));
trsuperobject.biblemap.put("b19_33_20", new trsuperobject(19,33,20,"Umudumuz RABdedir,Yardımcımız, kalkanımız Odur."));
trsuperobject.biblemap.put("b19_33_21", new trsuperobject(19,33,21,"Onda sevinç bulur yüreğimiz,Çünkü Onun kutsal adına güveniriz."));
trsuperobject.biblemap.put("b19_33_22", new trsuperobject(19,33,22,"Madem umudumuz sende,Sevgin üzerimizde olsun, ya RAB!"));
trsuperobject.biblemap.put("b19_34_1", new trsuperobject(19,34,1,"Her zaman RABbe övgüler sunacağım,Övgüsü dilimden düşmeyecek."));
trsuperobject.biblemap.put("b19_34_3", new trsuperobject(19,34,3,"Benimle birlikte RABbin büyüklüğünü duyurun,Adını birlikte yüceltelim."));
trsuperobject.biblemap.put("b19_34_5", new trsuperobject(19,34,5,"Ona bakanların yüzü ışıl ışıl parlar,Yüzleri utançtan kızarmaz."));
trsuperobject.biblemap.put("b19_34_6", new trsuperobject(19,34,6,"Bu mazlum yakardı, RAB duydu,Bütün sıkıntılarından kurtardı onu."));
trsuperobject.biblemap.put("b19_34_8", new trsuperobject(19,34,8,"Tadın da görün, RAB ne iyidir,Ne mutlu Ona sığınan adama!"));
trsuperobject.biblemap.put("b19_34_10", new trsuperobject(19,34,10,"Genç aslanlar bile aç ve muhtaç olur;Ama RABbe yönelenlerden hiçbir iyilik esirgenmez."));
trsuperobject.biblemap.put("b19_34_11", new trsuperobject(19,34,11,"Gelin, ey çocuklar, dinleyin beni:Size RAB korkusunu öğreteyim."));
trsuperobject.biblemap.put("b19_34_12", new trsuperobject(19,34,12,"Kim yaşamdan zevk almak,İyi günler görmek istiyorsa,"));
trsuperobject.biblemap.put("b19_34_13", new trsuperobject(19,34,13,"Dilini kötülükten,Dudaklarını yalandan uzak tutsun."));
trsuperobject.biblemap.put("b19_34_14", new trsuperobject(19,34,14,"Kötülükten sakının, iyilik yapın;Esenliği amaçlayın, ardınca gidin."));
trsuperobject.biblemap.put("b19_34_15", new trsuperobject(19,34,15,"RABbin gözleri doğru kişilerin üzerindedir,Kulakları onların yakarışına açıktır."));
trsuperobject.biblemap.put("b19_34_16", new trsuperobject(19,34,16,"RAB kötülük yapanlara karşıdır,Onların anısını yeryüzünden siler."));
trsuperobject.biblemap.put("b19_34_17", new trsuperobject(19,34,17,"Doğrular yakarır, RAB duyar;Bütün sıkıntılarından kurtarır onları."));
trsuperobject.biblemap.put("b19_34_18", new trsuperobject(19,34,18,"RAB gönlü kırıklara yakındır,Ruhu ezginleri kurtarır."));
trsuperobject.biblemap.put("b19_34_19", new trsuperobject(19,34,19,"Doğrunun dertleri çoktur,Ama RAB hepsinden kurtarır onu."));
trsuperobject.biblemap.put("b19_34_20", new trsuperobject(19,34,20,"Bütün kemiklerini korur,Hiçbiri kırılmaz."));
trsuperobject.biblemap.put("b19_34_21", new trsuperobject(19,34,21,"Kötü insanın sonu kötülükle biter,Cezasını bulur doğrulardan nefret edenler."));
trsuperobject.biblemap.put("b19_34_22", new trsuperobject(19,34,22,"RAB kullarını kurtarır,O'na sığınanların hiçbiri ceza görmez."));
trsuperobject.biblemap.put("b19_35_1", new trsuperobject(19,35,1,"Ya RAB, benimle uğraşanlarla sen uğraş,Benimle savaşanlarla sen savaş!"));
trsuperobject.biblemap.put("b19_35_2", new trsuperobject(19,35,2,"Al küçük kalkanla büyük kalkanı,Yardımıma koş!"));
trsuperobject.biblemap.put("b19_35_3", new trsuperobject(19,35,3,"Kaldır mızrağını, kargını beni kovalayanlara,‹‹Seni ben kurtarırım›› de bana!"));
trsuperobject.biblemap.put("b19_35_4", new trsuperobject(19,35,4,"Canıma kastedenler utanıp rezil olsun!Utançla geri çekilsin bana kötülük düşünenler!"));
trsuperobject.biblemap.put("b19_35_5", new trsuperobject(19,35,5,"Rüzgarın sürüklediği saman çöpüne dönsünler,RABbin meleği artlarına düşsün!"));
trsuperobject.biblemap.put("b19_35_6", new trsuperobject(19,35,6,"Karanlık ve kaygan olsun yolları,RABbin meleği kovalasın onları!"));
trsuperobject.biblemap.put("b19_35_7", new trsuperobject(19,35,7,"Madem neden yokken bana gizli ağlar kurdular,Nedensiz çukur kazdılar,"));
trsuperobject.biblemap.put("b19_35_8", new trsuperobject(19,35,8,"Başlarına habersiz felaket gelsin,Gizledikleri ağa kendileri tutulsun,Felakete uğrasınlar."));
trsuperobject.biblemap.put("b19_35_9", new trsuperobject(19,35,9,"O zaman RABde sevinç bulacağım,Beni kurtardığı için coşacağım."));
trsuperobject.biblemap.put("b19_35_10", new trsuperobject(19,35,10,"Bütün varlığımla şöyle diyeceğim:‹‹Senin gibisi var mı, ya RAB,Mazlumu zorbanın elinden,Mazlumu ve yoksulu soyguncudan kurtaran?››"));
trsuperobject.biblemap.put("b19_35_11", new trsuperobject(19,35,11,"Kötü niyetli tanıklar türüyor,Bilmediğim konuları soruyorlar."));
trsuperobject.biblemap.put("b19_35_12", new trsuperobject(19,35,12,"İyiliğime karşı kötülük ediyor,Yalnızlığa itiyorlar beni."));
trsuperobject.biblemap.put("b19_35_13-14", new trsuperobject(19,35,13-14,"Oysa onlar hastalanınca ben çula sarınır,Oruç tutup alçakgönüllü olurdum.Duam yanıtsız kalınca,Bir dost, bir kardeş yitirmiş gibi dolaşırdım.Kederden belim bükülürdü,Annesi için yas tutan biri gibi."));
trsuperobject.biblemap.put("b19_35_15", new trsuperobject(19,35,15,"Ama ben sendeleyince toplanıp sevindiler,Toplandı bana karşı tanımadığım alçaklar,Durmadan didiklediler beni."));
trsuperobject.biblemap.put("b19_35_16", new trsuperobject(19,35,16,"Tanrıtanımaz, alaycı soytarılar gibi,Diş gıcırdattılar bana."));
trsuperobject.biblemap.put("b19_35_17", new trsuperobject(19,35,17,"Ne zamana dek seyirci kalacaksın, ya Rab?Kurtar canımı bunların saldırısından,Hayatımı bu genç aslanlardan!"));
trsuperobject.biblemap.put("b19_35_18", new trsuperobject(19,35,18,"Büyük toplantıda sana şükürler sunacağım,Kalabalığın ortasında sana övgüler dizeceğim."));
trsuperobject.biblemap.put("b19_35_19", new trsuperobject(19,35,19,"Sevinmesin boş yere bana düşman olanlar,Göz kırpmasınlar birbirlerineNedensiz benden nefret edenler."));
trsuperobject.biblemap.put("b19_35_20", new trsuperobject(19,35,20,"Çünkü barış sözünü etmez onlar,Kurnazca düzen kurarlar ülkenin sakin insanlarına."));
trsuperobject.biblemap.put("b19_35_21", new trsuperobject(19,35,21,"Beni suçlamak için ağızlarını ardına kadar açtılar:‹‹Oh! Oh!›› diyorlar, ‹‹İşte kendi gözümüzle gördük yaptıklarını!››"));
trsuperobject.biblemap.put("b19_35_22", new trsuperobject(19,35,22,"Olup biteni sen de gördün, ya RAB, sessiz kalma,Ya Rab, benden uzak durma!"));
trsuperobject.biblemap.put("b19_35_23", new trsuperobject(19,35,23,"Uyan, kalk savun beni,Uğraş hakkım için, ey Tanrım ve Rabbim!"));
trsuperobject.biblemap.put("b19_35_24", new trsuperobject(19,35,24,"Adaletin uyarınca haklı çıkar beni, ya RAB, Tanrım benim!Gülmesinler halime!"));
trsuperobject.biblemap.put("b19_35_25", new trsuperobject(19,35,25,"Demesinler içlerinden:‹‹Oh! İşte buydu dileğimiz!››,Konuşmasınlar ardımdan:‹‹Yedik başını!›› diye."));
trsuperobject.biblemap.put("b19_35_26", new trsuperobject(19,35,26,"Utansın kötü halime sevinenler,Kızarsın yüzleri hepsinin;Gururla karşıma dikilenlerUtanca, rezalete bürünsün."));
trsuperobject.biblemap.put("b19_35_27", new trsuperobject(19,35,27,"Benim haklı çıkmamı isteyenler,Sevinç çığlıkları atıp coşsunlar;Şöyle desinler sürekli:‹‹Kulunun esenliğinden hoşlanan RAB yücelsin!››"));
trsuperobject.biblemap.put("b19_35_28", new trsuperobject(19,35,28,"O zaman gün boyu adaletin,Övgülerin dilimden düşmeyecek."));
trsuperobject.biblemap.put("b19_36_1", new trsuperobject(19,36,1,"Günah fısıldar kötü insana,Yüreğinin dibinden:Tanrı korkusu yoktur onda."));
trsuperobject.biblemap.put("b19_36_2", new trsuperobject(19,36,2,"Kendini öyle beğenmiş ki,Suçunu görmez, ondan tiksinmez."));
trsuperobject.biblemap.put("b19_36_3", new trsuperobject(19,36,3,"Ağzından kötülük ve yalan akar,Akıllanmaktan, iyilik yapmaktan vazgeçmiş."));
trsuperobject.biblemap.put("b19_36_4", new trsuperobject(19,36,4,"Yatağında bile fesat düşünür,Olumsuz yolda direnir, reddetmez kötülüğü."));
trsuperobject.biblemap.put("b19_36_5", new trsuperobject(19,36,5,"Ya RAB, sevgin göklere,Sadakatin gökyüzüne erişir."));
trsuperobject.biblemap.put("b19_36_6", new trsuperobject(19,36,6,"Doğruluğun ulu dağlara benzer,Adaletin uçsuz bucaksız enginlere.İnsanı da, hayvanı da koruyan sensin, ya RAB."));
trsuperobject.biblemap.put("b19_36_7", new trsuperobject(19,36,7,"Sevgin ne değerli, ey Tanrı!Kanatlarının gölgesine sığınır insanoğlu."));
trsuperobject.biblemap.put("b19_36_8", new trsuperobject(19,36,8,"Evindeki bolluğa doyarlar,Zevklerinin ırmağından içirirsin onlara."));
trsuperobject.biblemap.put("b19_36_9", new trsuperobject(19,36,9,"Çünkü yaşam kaynağı sensin,Senin ışığınla aydınlanırız."));
trsuperobject.biblemap.put("b19_36_10", new trsuperobject(19,36,10,"Sürekli gösterSeni tanıyanlara sevgini,Yüreği temiz olanlara doğruluğunu."));
trsuperobject.biblemap.put("b19_36_11", new trsuperobject(19,36,11,"Gururlunun ayağı bana varmasın,Kötülerin eli beni kovmasın."));
trsuperobject.biblemap.put("b19_36_12", new trsuperobject(19,36,12,"Kötülük yapanlar oracıkta düştüler,Yıkıldılar, kalkamazlar artık."));
trsuperobject.biblemap.put("b19_37_1", new trsuperobject(19,37,1,"Kötülük edenlere kızıp üzülme,Suç işleyenlere özenme!"));
trsuperobject.biblemap.put("b19_37_2", new trsuperobject(19,37,2,"Çünkü onlar ot gibi hemen solacak,Yeşil bitki gibi kuruyup gidecek."));
trsuperobject.biblemap.put("b19_37_3", new trsuperobject(19,37,3,"Sen RABbe güven, iyilik yap,Ülkede otur, sadakatle çalış."));
trsuperobject.biblemap.put("b19_37_5", new trsuperobject(19,37,5,"Her şeyi RABbe bırak,Ona güven, O gerekeni yapar."));
trsuperobject.biblemap.put("b19_37_6", new trsuperobject(19,37,6,"O senin doğruluğunu ışık gibi,Hakkını öğle güneşi gibiAydınlığa çıkarır."));
trsuperobject.biblemap.put("b19_37_8", new trsuperobject(19,37,8,"Kızmaktan kaçın, bırak öfkeyi,Üzülme, yalnız kötülüğe sürükler bu seni."));
trsuperobject.biblemap.put("b19_37_9", new trsuperobject(19,37,9,"Çünkü kötülerin kökü kazınacak,Ama RABbe umut bağlayanlar ülkeyi miras alacak."));
trsuperobject.biblemap.put("b19_37_10", new trsuperobject(19,37,10,"Yakında kötünün sonu gelecek,Yerini arasan da bulunmayacak."));
trsuperobject.biblemap.put("b19_37_11", new trsuperobject(19,37,11,"Ama alçakgönüllüler ülkeyi miras alacak,Derin bir huzurun zevkini tadacak."));
trsuperobject.biblemap.put("b19_37_12", new trsuperobject(19,37,12,"Kötü insan doğru insana düzen kurar,Diş gıcırdatır."));
trsuperobject.biblemap.put("b19_37_13", new trsuperobject(19,37,13,"Ama Rab kötüye güler,Çünkü bilir onun sonunun geldiğini."));
trsuperobject.biblemap.put("b19_37_14", new trsuperobject(19,37,14,"Kılıç çekti kötüler, yaylarını gerdi,Mazlumu, yoksulu yıkmak,Doğru yolda olanları öldürmek için."));
trsuperobject.biblemap.put("b19_37_15", new trsuperobject(19,37,15,"Ama kılıçları kendi yüreklerine saplanacak,Yayları kırılacak."));
trsuperobject.biblemap.put("b19_37_16", new trsuperobject(19,37,16,"Doğrunun azıcık varlığı,Pek çok kötünün servetinden iyidir."));
trsuperobject.biblemap.put("b19_37_17", new trsuperobject(19,37,17,"Çünkü kötülerin gücü kırılacak,Ama doğrulara RAB destek olacak."));
trsuperobject.biblemap.put("b19_37_18", new trsuperobject(19,37,18,"RAB yetkinlerin her gününü gözetir,Onların mirası sonsuza dek sürecek."));
trsuperobject.biblemap.put("b19_37_19", new trsuperobject(19,37,19,"Kötü günde utanmayacaklar,Kıtlıkta karınları doyacak."));
trsuperobject.biblemap.put("b19_37_20", new trsuperobject(19,37,20,"Ama kötüler yıkıma uğrayacak;RABbin düşmanları kır çiçekleri gibi kuruyup gidecek,Duman gibi dağılıp yok olacak."));
trsuperobject.biblemap.put("b19_37_21", new trsuperobject(19,37,21,"Kötüler ödünç alır, geri vermez;Doğrularsa cömertçe verir."));
trsuperobject.biblemap.put("b19_37_22", new trsuperobject(19,37,22,"RABbin kutsadığı insanlar ülkeyi miras alacak,Lanetlediği insanların kökü kazınacak."));
trsuperobject.biblemap.put("b19_37_23", new trsuperobject(19,37,23,"RAB insana sağlam adım attırır,İnsanın yolundan hoşnut olursa."));
trsuperobject.biblemap.put("b19_37_24", new trsuperobject(19,37,24,"Düşse bile yıkılmaz insan,Çünkü elinden tutan RABdir."));
trsuperobject.biblemap.put("b19_37_25", new trsuperobject(19,37,25,"Gençtim, ömrüm tükendi,Ama hiç görmedim doğru insanın terk edildiğini,Soyunun ekmek dilendiğini."));
trsuperobject.biblemap.put("b19_37_26", new trsuperobject(19,37,26,"O hep cömertçe ödünç verir,Soyu kutsanır."));
trsuperobject.biblemap.put("b19_37_27", new trsuperobject(19,37,27,"Kötülükten kaç, iyilik yap;Sonsuz yaşama kavuşursun."));
trsuperobject.biblemap.put("b19_37_28", new trsuperobject(19,37,28,"Çünkü RAB doğruyu sever,Sadık kullarını terk etmez.Onlar sonsuza dek korunacak,Kötülerinse kökü kazınacak."));
trsuperobject.biblemap.put("b19_37_29", new trsuperobject(19,37,29,"Doğrular ülkeyi miras alacak,Orada sonsuza dek yaşayacak."));
trsuperobject.biblemap.put("b19_37_30", new trsuperobject(19,37,30,"Doğrunun ağzından bilgelik akar,Dilinden adalet damlar."));
trsuperobject.biblemap.put("b19_37_31", new trsuperobject(19,37,31,"Tanrısının yasası yüreğindedir,Ayakları kaymaz."));
trsuperobject.biblemap.put("b19_37_32", new trsuperobject(19,37,32,"Kötü, doğruya pusu kurar,Onu öldürmeye çalışır."));
trsuperobject.biblemap.put("b19_37_33", new trsuperobject(19,37,33,"Ama RAB onu kötünün eline düşürmez,Yargılanırken mahkûm etmez."));
trsuperobject.biblemap.put("b19_37_34", new trsuperobject(19,37,34,"RABbe umut bağla, Onun yolunu tut,Ülkeyi miras almak üzere seni yükseltecektir.Kötülerin kökünün kazındığını göreceksin."));
trsuperobject.biblemap.put("b19_37_35", new trsuperobject(19,37,35,"Kötü ve acımasız adamı gördüm,İlk dikildiği toprakta yeşeren ağaç gibiDal budak salıyordu;"));
trsuperobject.biblemap.put("b19_37_36", new trsuperobject(19,37,36,"Geçip gitti, yok oldu,Aradım, bulunmaz oldu."));
trsuperobject.biblemap.put("b19_37_37", new trsuperobject(19,37,37,"Yetkin adamı gözle, doğru adama bak,Çünkü yarınlar barışseverindir."));
trsuperobject.biblemap.put("b19_37_38", new trsuperobject(19,37,38,"Ama başkaldıranların hepsi yok olacak,Kötülerin kökü kazınacak."));
trsuperobject.biblemap.put("b19_37_39", new trsuperobject(19,37,39,"Doğruların kurtuluşu RABden gelir,Sıkıntılı günde onlara kale olur."));
trsuperobject.biblemap.put("b19_37_40", new trsuperobject(19,37,40,"RAB onlara yardım eder, kurtarır onları,Kötülerin elinden alıp özgür kılar,Çünkü kendisine sığınırlar."));
trsuperobject.biblemap.put("b19_38_1", new trsuperobject(19,38,1,"Ya RAB, öfkelenip azarlama beni,Gazapla yola getirme!"));
trsuperobject.biblemap.put("b19_38_2", new trsuperobject(19,38,2,"Okların içime saplandı,Elin üzerime indi."));
trsuperobject.biblemap.put("b19_38_3", new trsuperobject(19,38,3,"Öfken yüzünden sağlığım bozuldu,Günahım yüzünden rahatım kaçtı."));
trsuperobject.biblemap.put("b19_38_4", new trsuperobject(19,38,4,"Çünkü suçlarım başımdan aştı,Taşınmaz bir yük gibi sırtımda ağırlaştı."));
trsuperobject.biblemap.put("b19_38_5", new trsuperobject(19,38,5,"Akılsızlığım yüzündenYaralarım iğrenç, irinli."));
trsuperobject.biblemap.put("b19_38_6", new trsuperobject(19,38,6,"Eğildim, iki büklüm oldum,Gün boyu yaslı dolaşıyorum."));
trsuperobject.biblemap.put("b19_38_7", new trsuperobject(19,38,7,"Çünkü belim ateş içinde,Sağlığım bozuk."));
trsuperobject.biblemap.put("b19_38_8", new trsuperobject(19,38,8,"Tükendim, ezildim alabildiğine,İnliyorum yüreğimin acısından."));
trsuperobject.biblemap.put("b19_38_9", new trsuperobject(19,38,9,"Ya Rab, bütün özlemlerimi bilirsin,İniltilerim senden gizli değil."));
trsuperobject.biblemap.put("b19_38_10", new trsuperobject(19,38,10,"Yüreğim çarpıyor, gücüm tükeniyor,Gözlerimin feri bile söndü."));
trsuperobject.biblemap.put("b19_38_11", new trsuperobject(19,38,11,"Eşim dostum kaçar oldu derdimden,Yakınlarım uzak duruyor benden."));
trsuperobject.biblemap.put("b19_38_12", new trsuperobject(19,38,12,"Canıma susayanlar bana tuzak kuruyor,Zararımı isteyenler kuyumu kazıyor,Gün boyu hileler düşünüyorlar."));
trsuperobject.biblemap.put("b19_38_13", new trsuperobject(19,38,13,"Ama ben bir sağır gibi duymuyorum,Bir dilsiz gibi ağzımı açmıyorum;"));
trsuperobject.biblemap.put("b19_38_14", new trsuperobject(19,38,14,"Duymaz,Ağzında yanıt bulunmaz bir adama döndüm."));
trsuperobject.biblemap.put("b19_38_15", new trsuperobject(19,38,15,"Umudum sende, ya RAB,Sen yanıtlayacaksın, ya Rab, Tanrım benim!"));
trsuperobject.biblemap.put("b19_38_16", new trsuperobject(19,38,16,"Çünkü dua ediyorum: ‹‹Halime sevinmesinler,Ayağım kayınca böbürlenmesinler!››"));
trsuperobject.biblemap.put("b19_38_17", new trsuperobject(19,38,17,"Düşmek üzereyim,Acım hep içimde."));
trsuperobject.biblemap.put("b19_38_18", new trsuperobject(19,38,18,"Suçumu itiraf ediyorum,Günahım yüzünden kaygılanıyorum."));
trsuperobject.biblemap.put("b19_38_19", new trsuperobject(19,38,19,"Ama düşmanlarım güçlü ve dinç,Yok yere benden nefret edenler çok."));
trsuperobject.biblemap.put("b19_38_20", new trsuperobject(19,38,20,"İyiliğe karşı kötülük yapanlar bana karşı çıkar,İyiliğin peşinde olduğum için."));
trsuperobject.biblemap.put("b19_38_21", new trsuperobject(19,38,21,"Beni terk etme, ya RAB!Ey Tanrım, benden uzak durma!"));
trsuperobject.biblemap.put("b19_38_22", new trsuperobject(19,38,22,"Yardımıma koş,Ya Rab, kurtuluşum benim!"));
trsuperobject.biblemap.put("b19_39_1", new trsuperobject(19,39,1,"Karar verdim: ‹‹Adımlarıma dikkat edeceğim,Dilimi günahtan sakınacağım;Karşımda kötü biri oldukça,Ağzıma gem vuracağım.››"));
trsuperobject.biblemap.put("b19_39_2", new trsuperobject(19,39,2,"Dilimi tutup sustum,Hep kaçındım konuşmaktan, yararı olsa bile.Acım alevlendi,"));
trsuperobject.biblemap.put("b19_39_3", new trsuperobject(19,39,3,"Yüreğim tutuştu içimde,Ateş aldı derin derin düşünürken,Şu sözler döküldü dilimden:"));
trsuperobject.biblemap.put("b19_39_4", new trsuperobject(19,39,4,"‹‹Bildir bana, ya RAB, sonumu,Sayılı günlerimi;Bileyim ömrümün ne kadar kısa olduğunu!"));
trsuperobject.biblemap.put("b19_39_5", new trsuperobject(19,39,5,"Yalnız bir karış ömür verdin bana,Hiç kalır hayatım senin önünde.Her insan bir soluktur sadece,En güçlü çağında bile. Sela"));
trsuperobject.biblemap.put("b19_39_6", new trsuperobject(19,39,6,"‹‹Bir gölge gibi dolaşır insan,Boş yere çırpınır,Mal biriktirir, kime kalacağını bilmeden."));
trsuperobject.biblemap.put("b19_39_7", new trsuperobject(19,39,7,"‹‹Ne bekleyebilirim şimdi, ya Rab?Umudum sende."));
trsuperobject.biblemap.put("b19_39_8", new trsuperobject(19,39,8,"Kurtar beni bütün isyanlarımdan,Aptalların hakaretine izin verme."));
trsuperobject.biblemap.put("b19_39_9", new trsuperobject(19,39,9,"Sustum, açmayacağım ağzımı;Çünkü sensin bunu yapan."));
trsuperobject.biblemap.put("b19_39_10", new trsuperobject(19,39,10,"Uzaklaştır üzerimden yumruklarını,Tokadının altında mahvoldum."));
trsuperobject.biblemap.put("b19_39_11", new trsuperobject(19,39,11,"Sen insanı suçundan ötürüAzarlayarak yola getirirsin,Güve gibi tüketirsin sevdiği şeyleri.Her insan bir soluktur sadece. Sela"));
trsuperobject.biblemap.put("b19_39_12", new trsuperobject(19,39,12,"‹‹Duamı işit, ya RAB,Kulak ver yakarışıma,Gözyaşlarıma kayıtsız kalma!Çünkü ben bir garibim senin yanında,Bir yabancı, atalarım gibi."));
trsuperobject.biblemap.put("b19_39_13", new trsuperobject(19,39,13,"Uzaklaştır üzerimden bakışlarını,Göçüp yok olmadan mutlu olayım!››"));
trsuperobject.biblemap.put("b19_40_2", new trsuperobject(19,40,2,"Ölüm çukurundan,Balçıktan çıkardı beni,Ayaklarımı kaya üzerinde tuttu,Kaymayayım diye."));
trsuperobject.biblemap.put("b19_40_3", new trsuperobject(19,40,3,"Ağzıma yeni bir ezgi,Tanrımıza bir övgü ilahisi koydu.Çokları görüp korkacakVe RABbe güvenecekler."));
trsuperobject.biblemap.put("b19_40_4", new trsuperobject(19,40,4,"Ne mutlu RABbe güvenen insana,Gururluya, yalana sapana ilgi duymayana."));
trsuperobject.biblemap.put("b19_40_5", new trsuperobject(19,40,5,"Ya RAB, Tanrım,Harikaların, düşüncelerin ne çoktur bizim için;Sana eş koşulmaz!Duyurmak, anlatmak istesem yaptıklarını,Saymakla bitmez."));
trsuperobject.biblemap.put("b19_40_6", new trsuperobject(19,40,6,"Kurbandan, sunudan hoşnut olmadın,Ama kulaklarımı açtın.Yakmalık sunu, günah sunusu da istemedin."));
trsuperobject.biblemap.put("b19_40_7-8", new trsuperobject(19,40,7-8,"O zaman şöyle dedim: ‹‹İşte geldim;Kutsal Yazı tomarında benim için yazılmıştır.Ey Tanrım, senin isteğini yapmaktan zevk alırım ben,Yasan yüreğimin derinliğindedir.››"));
trsuperobject.biblemap.put("b19_40_9", new trsuperobject(19,40,9,"Büyük toplantıda müjdelerim senin zaferini,Sözümü esirgemem,Ya RAB, bildiğin gibi!"));
trsuperobject.biblemap.put("b19_40_10", new trsuperobject(19,40,10,"Zaferini içimde gizlemem,Bağlılığını ve kurtarışını duyururum,Sevgini, sadakatini saklamam büyük topluluktan."));
trsuperobject.biblemap.put("b19_40_11", new trsuperobject(19,40,11,"Ya RAB, esirgeme sevecenliğini benden!Sevgin, sadakatin hep korusun beni!"));
trsuperobject.biblemap.put("b19_40_12", new trsuperobject(19,40,12,"Sayısız belalar çevremi sardı,Suçlarım bana yetişti, önümü göremiyorum;Başımdaki saçlardan daha çoklar,Çaresiz kaldım."));
trsuperobject.biblemap.put("b19_40_13", new trsuperobject(19,40,13,"Ne olur, ya RAB, kurtar beni!Yardımıma koş, ya RAB!"));
trsuperobject.biblemap.put("b19_40_14", new trsuperobject(19,40,14,"Utansın canımı almaya çalışanlar,Yüzleri kızarsın!Geri dönsün zararımı isteyenler,Rezil olsunlar!"));
trsuperobject.biblemap.put("b19_40_15", new trsuperobject(19,40,15,"Bana, ‹‹Oh! Oh!›› çekenlerDehşete düşsün utançlarından!"));
trsuperobject.biblemap.put("b19_40_16", new trsuperobject(19,40,16,"Sende neşe ve sevinç bulsunBütün sana yönelenler!‹‹RAB yücedir!›› desin hepSenin kurtarışını özleyenler!"));
trsuperobject.biblemap.put("b19_40_17", new trsuperobject(19,40,17,"Bense mazlum ve yoksulum,Düşün beni, ya Rab.Yardımcım ve kurtarıcım sensin,Geç kalma, ey Tanrım!"));
trsuperobject.biblemap.put("b19_41_1", new trsuperobject(19,41,1,"Ne mutlu yoksulu düşünene!RAB kurtarır onu kötü günde."));
trsuperobject.biblemap.put("b19_41_2", new trsuperobject(19,41,2,"Korur RAB, yaşatır onu,Ülkede mutlu kılar,Terk etmez düşmanlarının eline."));
trsuperobject.biblemap.put("b19_41_3", new trsuperobject(19,41,3,"Destek olur RAB onaYatağa düşünce;Hastalandığında sağlığa kavuşturur onu."));
trsuperobject.biblemap.put("b19_41_4", new trsuperobject(19,41,4,"‹‹Acı bana, ya RAB!›› dedim,‹‹Şifa ver bana, çünkü sana karşı günah işledim!››"));
trsuperobject.biblemap.put("b19_41_5", new trsuperobject(19,41,5,"Kötü konuşuyor düşmanlarım ardımdan:‹‹Ne zaman ölecek adı batası?›› diyorlar."));
trsuperobject.biblemap.put("b19_41_6", new trsuperobject(19,41,6,"Biri beni görmeye geldi mi, boş laf ediyor,Fesat topluyor içinde,Sonra dışarı çıkıp fesadı yayıyor."));
trsuperobject.biblemap.put("b19_41_7", new trsuperobject(19,41,7,"Benden nefret edenlerin hepsiFısıldaşıyor aralarında bana karşı,Zararımı düşünüyorlar,"));
trsuperobject.biblemap.put("b19_41_8", new trsuperobject(19,41,8,"‹‹Başına öyle kötü bir şey geldi ki›› diyorlar,‹‹Yatağından kalkamaz artık.››"));
trsuperobject.biblemap.put("b19_41_9", new trsuperobject(19,41,9,"Ekmeğimi yiyen, güvendiğim yakın dostum bileİhanet etti bana."));
trsuperobject.biblemap.put("b19_41_10", new trsuperobject(19,41,10,"Bari sen acı bana, ya RAB, kaldır beni.Bunların hakkından geleyim."));
trsuperobject.biblemap.put("b19_41_11", new trsuperobject(19,41,11,"Düşmanım zafer çığlığı atmazsa,O zaman anlarım benden hoşnut kaldığını."));
trsuperobject.biblemap.put("b19_41_12", new trsuperobject(19,41,12,"Dürüstlüğümden ötürü bana destek olur,Sonsuza dek beni huzurunda tutarsın."));
trsuperobject.biblemap.put("b19_41_13", new trsuperobject(19,41,13,"Öncesizlikten sonsuza dek,Övgüler olsun İsrail'in Tanrısı RAB'be!Amin! Amin!"));
trsuperobject.biblemap.put("b19_42_1", new trsuperobject(19,42,1,"Geyik akarsuları nasıl özlerse,Canım da seni öyle özler, ey Tanrı! yazılır."));
trsuperobject.biblemap.put("b19_42_2", new trsuperobject(19,42,2,"Canım Tanrıya, yaşayan Tanrıya susadı;Ne zaman görmeye gideceğim Tanrının yüzünü?"));
trsuperobject.biblemap.put("b19_42_3", new trsuperobject(19,42,3,"Gözyaşlarım ekmeğim oldu gece gündüz,Gün boyu, ‹‹Nerede senin Tanrın?›› dedikleri için."));
trsuperobject.biblemap.put("b19_42_4", new trsuperobject(19,42,4,"Anımsayınca içim içimi yiyor,Nasıl toplulukla birlikte yürür,Tanrının evine kadar alaya öncülük ederdim,Sevinç ve şükran sesleri arasında,Bayram eden bir kalabalıkla birlikte."));
trsuperobject.biblemap.put("b19_42_5", new trsuperobject(19,42,5,"Neden üzgünsün, ey gönlüm,Neden içim huzursuz?Tanrıya umut bağla,Çünkü Ona yine övgüler sunacağım;O benim kurtarıcım ve Tanrımdır."));
trsuperobject.biblemap.put("b19_42_6-7", new trsuperobject(19,42,6-7,"Gönlüm üzgün,Bu yüzden seni anımsıyorum, ey Tanrım.Şeria yöresinde, Hermon ve Misar dağlarındaÇağlayanların gümbürdeyince,Enginler birbirine sesleniyor,Bütün dalgaların, sellerin üzerimden geçiyor."));
trsuperobject.biblemap.put("b19_42_8", new trsuperobject(19,42,8,"Gündüz RAB sevgisini gösterir,Gece ilahi söyler, dua ederimYaşamımın Tanrısına."));
trsuperobject.biblemap.put("b19_42_9", new trsuperobject(19,42,9,"Kayam olan Tanrıma diyorum ki,‹‹Neden beni unuttun?Niçin düşmanlarımın baskısı altındaYaslı gezeyim?››"));
trsuperobject.biblemap.put("b19_42_10", new trsuperobject(19,42,10,"Gün boyu hasımlarım: ‹‹Nerede senin Tanrın?›› diyerekBana sataştıkça,Kemiklerim kırılıyor sanki."));
trsuperobject.biblemap.put("b19_42_11", new trsuperobject(19,42,11,"Neden üzgünsün, ey gönlüm,Neden içim huzursuz?Tanrı'ya umut bağla,Çünkü O'na yine övgüler sunacağım;O benim kurtarıcım ve Tanrım'dır."));
trsuperobject.biblemap.put("b19_43_1", new trsuperobject(19,43,1,"Hakkımı ara, ey Tanrı,Savun beni vefasız ulusa karşı,Kurtar hileci, haksız insandan."));
trsuperobject.biblemap.put("b19_43_2", new trsuperobject(19,43,2,"Çünkü sen Tanrım, kalemsin;Neden beni reddettin?Niçin düşmanlarımın baskısı altındaYaslı gezeyim?"));
trsuperobject.biblemap.put("b19_43_3", new trsuperobject(19,43,3,"Gönder ışığını, gerçeğini,Yol göstersinler bana,Senin kutsal dağına, konutuna götürsünler beni."));
trsuperobject.biblemap.put("b19_43_4", new trsuperobject(19,43,4,"O zaman Tanrının sunağına,Neşe, sevinç kaynağım Tanrıya gideceğimVe sana, ey Tanrı, Tanrım benim,Lirle şükredeceğim."));
trsuperobject.biblemap.put("b19_43_5", new trsuperobject(19,43,5,"Neden üzgünsün, ey gönlüm,Neden içim huzursuz?Tanrı'ya umut bağla,Çünkü O'na yine övgüler sunacağım;O benim kurtarıcım ve Tanrım'dır."));
trsuperobject.biblemap.put("b19_44_1", new trsuperobject(19,44,1,"Ey Tanrı, kulaklarımızla duyduk,Atalarımız anlattı bize,Neler yaptığını onların gününde, eski günlerde."));
trsuperobject.biblemap.put("b19_44_2", new trsuperobject(19,44,2,"Elinle ulusları kovdun,Ama atalarımıza yer verdin;Halkları kırdın,Ama atalarımızın yayılmasını sağladın."));
trsuperobject.biblemap.put("b19_44_3", new trsuperobject(19,44,3,"Onlar ülkeyi kılıçla kazanmadılar,Kendi bilekleriyle zafere ulaşmadılar.Senin sağ elin, bileğin, yüzünün ışığı sayesinde oldu bu;Çünkü sen onları sevdin."));
trsuperobject.biblemap.put("b19_44_4", new trsuperobject(19,44,4,"Ey Tanrı, kralım sensin,Buyruk ver de Yakup soyu kazansın!"));
trsuperobject.biblemap.put("b19_44_5", new trsuperobject(19,44,5,"Senin sayende düşmanlarımızı püskürteceğiz,Senin adınla karşıtlarımızı ezeceğiz."));
trsuperobject.biblemap.put("b19_44_6", new trsuperobject(19,44,6,"Çünkü ben yayıma güvenmem,Kılıcım da beni kurtarmaz;"));
trsuperobject.biblemap.put("b19_44_7", new trsuperobject(19,44,7,"Ancak sensin bizi düşmanlarımızdan kurtaran,Bizden nefret edenleri utanca boğan."));
trsuperobject.biblemap.put("b19_44_8", new trsuperobject(19,44,8,"Her gün Tanrıyla övünür,Sonsuza dek adına şükran sunarız. Sela"));
trsuperobject.biblemap.put("b19_44_9", new trsuperobject(19,44,9,"Ne var ki, reddettin bizi, aşağıladın,Artık ordularımızla savaşa çıkmıyorsun."));
trsuperobject.biblemap.put("b19_44_10", new trsuperobject(19,44,10,"Düşman karşısında bizi gerilettin,Bizden tiksinenler bizi soydu."));
trsuperobject.biblemap.put("b19_44_11", new trsuperobject(19,44,11,"Kasaplık koyuna çevirdin bizi,Ulusların arasına dağıttın."));
trsuperobject.biblemap.put("b19_44_12", new trsuperobject(19,44,12,"Yok pahasına sattın halkını,Üstelik satıştan hiçbir şey kazanmadan."));
trsuperobject.biblemap.put("b19_44_13", new trsuperobject(19,44,13,"Bizi komşularımızın yüzkarası,Çevremizdekilerin eğlencesi, alay konusu ettin."));
trsuperobject.biblemap.put("b19_44_14", new trsuperobject(19,44,14,"Ulusların diline düşürdün bizi,Gülüyor halklar halimize."));
trsuperobject.biblemap.put("b19_44_15", new trsuperobject(19,44,15,"Rezilliğim gün boyu karşımda,Utancımdan yerin dibine geçtim"));
trsuperobject.biblemap.put("b19_44_16", new trsuperobject(19,44,16,"Hakaret ve sövgü duya duya,Öç almak isteyen düşman karşısında."));
trsuperobject.biblemap.put("b19_44_17", new trsuperobject(19,44,17,"Bütün bunlar başımıza geldi,Yine de seni unutmadık,Antlaşmana ihanet etmedik,"));
trsuperobject.biblemap.put("b19_44_18", new trsuperobject(19,44,18,"Döneklik etmedik,Adımlarımız senin yolundan sapmadı."));
trsuperobject.biblemap.put("b19_44_19", new trsuperobject(19,44,19,"Oysa sen bizi ezdin, ülkemizi çakalların uğrağı ettin,Üstümüzü koyu karanlıkla örttün."));
trsuperobject.biblemap.put("b19_44_20", new trsuperobject(19,44,20,"Eğer Tanrımızın adını unutsaydık,Yabancı bir ilaha ellerimizi açsaydık,"));
trsuperobject.biblemap.put("b19_44_21", new trsuperobject(19,44,21,"Tanrı bunu ortaya çıkarmaz mıydı?Çünkü O yürekteki gizleri bilir."));
trsuperobject.biblemap.put("b19_44_22", new trsuperobject(19,44,22,"Senin uğruna her gün öldürülüyoruz,Kasaplık koyun sayılıyoruz."));
trsuperobject.biblemap.put("b19_44_23", new trsuperobject(19,44,23,"Uyan, ya Rab! Niçin uyuyorsun?Kalk! Sonsuza dek terk etme bizi!"));
trsuperobject.biblemap.put("b19_44_24", new trsuperobject(19,44,24,"Niçin yüzünü gizliyorsun?Neden mazlum halimizi, üzerimizdeki baskıyı unutuyorsun?"));
trsuperobject.biblemap.put("b19_44_25", new trsuperobject(19,44,25,"Çünkü yere serildik,Bedenimiz toprağa yapıştı."));
trsuperobject.biblemap.put("b19_44_26", new trsuperobject(19,44,26,"Kalk, yardım et bize!Kurtar bizi sevgin uğruna!"));
trsuperobject.biblemap.put("b19_45_1", new trsuperobject(19,45,1,"Yüreğimden güzel sözler taşıyor,Kral için söylüyorum şiirlerimi,Dilim usta bir yazarın kalemi gibi olsun."));
trsuperobject.biblemap.put("b19_45_2", new trsuperobject(19,45,2,"Sen insanların en güzelisin,Lütuf saçılmış dudaklarına.Çünkü Tanrı seni sonsuza dek kutsamış."));
trsuperobject.biblemap.put("b19_45_3", new trsuperobject(19,45,3,"Ey yiğit savaşçı, kuşan kılıcını beline,Görkemine, yüceliğine bürün."));
trsuperobject.biblemap.put("b19_45_4", new trsuperobject(19,45,4,"At sırtında görkeminle, zaferle ilerle,Gerçek ve adalet uğrunaSağ elin korkunç işler göstersin. ‹‹Gerçek ve alçakgönüllülük, adalet uğruna››."));
trsuperobject.biblemap.put("b19_45_5", new trsuperobject(19,45,5,"Okların sivridir,Kral düşmanlarının yüreğine saplanır,Halklar ayaklarının altına serilir."));
trsuperobject.biblemap.put("b19_45_6", new trsuperobject(19,45,6,"Ey Tanrı, tahtın sonsuzluklar boyunca kalıcıdırfö,Krallığının asası adalet asasıdır. da ‹‹Tanrının sana armağan ettiği krallık sonsuzluklar boyunca kalıcıdır››."));
trsuperobject.biblemap.put("b19_45_7", new trsuperobject(19,45,7,"Doğruluğu sever, kötülükten nefret edersin.Bunun için Tanrı, senin Tanrın,Seni sevinç yağıylaArkadaşlarından daha çok meshetti."));
trsuperobject.biblemap.put("b19_45_8", new trsuperobject(19,45,8,"Giysilerinin tümü mür, öd, tarçın kokuyor;Fildişi saraylardan gelen çalgı sesleri seni eğlendiriyor!"));
trsuperobject.biblemap.put("b19_45_9", new trsuperobject(19,45,9,"Kral kızları senin saygın kadınların arasında,Kraliçe, Ofir altınları içinde senin sağında duruyor."));
trsuperobject.biblemap.put("b19_45_10", new trsuperobject(19,45,10,"Dinle, ey kral kızı, bak, kulak ver,Halkını, baba evini unut."));
trsuperobject.biblemap.put("b19_45_11", new trsuperobject(19,45,11,"Kral senin güzelliğine vuruldu,Efendin olduğu için önünde eğil."));
trsuperobject.biblemap.put("b19_45_12", new trsuperobject(19,45,12,"Sur halkı armağan getirecek,Halkın zenginleri lütfunu kazanmak isteyecek."));
trsuperobject.biblemap.put("b19_45_13", new trsuperobject(19,45,13,"Kral kızı odasında ışıl ışıl parıldıyor,Giysisi altınla dokunmuş."));
trsuperobject.biblemap.put("b19_45_14", new trsuperobject(19,45,14,"İşlemeli giysiler içinde kralın önüne çıkarılacak,Arkadaşları, ona eşlik eden kızlar sana getirilecek."));
trsuperobject.biblemap.put("b19_45_15", new trsuperobject(19,45,15,"Sevinç ve coşkuyla götürülecek,Kralın sarayına girecekler."));
trsuperobject.biblemap.put("b19_45_16", new trsuperobject(19,45,16,"Atalarının yerini oğulların alacak,Onları önder yapacaksın bütün ülkeye."));
trsuperobject.biblemap.put("b19_45_17", new trsuperobject(19,45,17,"Adını kuşaklar boyunca yaşatacağım,Böylece halklar sonsuza dek övecek seni."));
trsuperobject.biblemap.put("b19_46_1", new trsuperobject(19,46,1,"Tanrı sığınağımız ve gücümüzdür,Sıkıntıda hep yardıma hazırdır. bilinmeyen bir müzik terimi."));
trsuperobject.biblemap.put("b19_46_2", new trsuperobject(19,46,2,"Bu yüzden korkmayız yeryüzü altüst olsa,Dağlar denizlerin bağrına devrilse,"));
trsuperobject.biblemap.put("b19_46_3", new trsuperobject(19,46,3,"Sular kükreyip köpürse,Kabaran deniz dağları titretse bile. Sela"));
trsuperobject.biblemap.put("b19_46_4", new trsuperobject(19,46,4,"Bir ırmak var ki, suları sevinç getirir Tanrı kentine,Yüceler Yücesinin kutsal konutuna."));
trsuperobject.biblemap.put("b19_46_5", new trsuperobject(19,46,5,"Tanrı onun ortasındadır,Sarsılmaz o kent.Gün doğarken Tanrı ona yardım eder."));
trsuperobject.biblemap.put("b19_46_6", new trsuperobject(19,46,6,"Uluslar kükrüyor, krallıklar sarsılıyor,Tanrı gürleyince yeryüzü eriyip gidiyor."));
trsuperobject.biblemap.put("b19_46_7", new trsuperobject(19,46,7,"Her Şeye Egemen RAB bizimledir,Yakupun Tanrısı kalemizdir. Sela"));
trsuperobject.biblemap.put("b19_46_8", new trsuperobject(19,46,8,"Gelin, görün RABbin yaptıklarını,Yeryüzüne getirdiği yıkımları."));
trsuperobject.biblemap.put("b19_46_9", new trsuperobject(19,46,9,"Savaşları durdurur yeryüzünün dört bucağında,Yayları kırar, mızrakları parçalar,Kalkanları yakar."));
trsuperobject.biblemap.put("b19_46_10", new trsuperobject(19,46,10,"‹‹Sakin olun, bilin ki, Tanrı benim!Uluslar arasında yüceleceğim,Yeryüzünde yüceleceğim!››"));
trsuperobject.biblemap.put("b19_46_11", new trsuperobject(19,46,11,"Her Şeye Egemen RAB bizimledir,Yakup'un Tanrısı kalemizdir. Sela"));
trsuperobject.biblemap.put("b19_47_1", new trsuperobject(19,47,1,"Ey bütün uluslar, el çırpın!Sevinç çığlıkları atın Tanrının onuruna!"));
trsuperobject.biblemap.put("b19_47_2", new trsuperobject(19,47,2,"Ne müthiştir yüce RAB,Bütün dünyanın ulu Kralı."));
trsuperobject.biblemap.put("b19_47_3", new trsuperobject(19,47,3,"Halkları altımıza,Ulusları ayaklarımızın dibine serer."));
trsuperobject.biblemap.put("b19_47_4", new trsuperobject(19,47,4,"Sevdiği Yakupun gururu olan mirasımızıO seçti bizim için. Sela"));
trsuperobject.biblemap.put("b19_47_6", new trsuperobject(19,47,6,"Ezgiler sunun Tanrıya, ezgiler;Ezgiler sunun Kralımıza, ezgiler!"));
trsuperobject.biblemap.put("b19_47_7", new trsuperobject(19,47,7,"Çünkü Tanrı bütün dünyanın kralıdır,Maskil sunun! edebiyat terimi. ‹‹Didaktik şiir›› anlamına gelebilir."));
trsuperobject.biblemap.put("b19_47_8", new trsuperobject(19,47,8,"Tanrı kutsal tahtına oturmuş,Krallık eder uluslara."));
trsuperobject.biblemap.put("b19_47_9", new trsuperobject(19,47,9,"Ulusların önderleriİbrahim'in Tanrısı'nın halkıyla bir araya gelmiş;Çünkü Tanrı'ya aittir yeryüzü kralları.O çok yücedir."));
trsuperobject.biblemap.put("b19_48_2", new trsuperobject(19,48,2,"Yükselir zarafetle,Bütün yeryüzünün sevinci Siyon Dağı,Safonunfş doruğu, ulu Kralın kenti."));
trsuperobject.biblemap.put("b19_48_3", new trsuperobject(19,48,3,"Tanrı onun kalelerindeSağlam kule olarak gösterdi kendini."));
trsuperobject.biblemap.put("b19_48_4", new trsuperobject(19,48,4,"Krallar toplandı,Birlikte Siyonun üzerine yürüdüler."));
trsuperobject.biblemap.put("b19_48_5", new trsuperobject(19,48,5,"Ama onu görünce şaşkına döndüler,Dehşete düşüp kaçtılar."));
trsuperobject.biblemap.put("b19_48_6", new trsuperobject(19,48,6,"Doğum sancısı tutan kadın gibi,Bir titreme aldı onları orada."));
trsuperobject.biblemap.put("b19_48_7", new trsuperobject(19,48,7,"Doğu rüzgarının parçaladığı ticaret gemileri gibiYok ettin onları."));
trsuperobject.biblemap.put("b19_48_8", new trsuperobject(19,48,8,"Her Şeye Egemen RABbin kentinde,Tanrımızın kentinde,Nasıl duyduksa, öyle gördük.Tanrı onu sonsuza dek güvenlik içinde tutacak. Sela"));
trsuperobject.biblemap.put("b19_48_9", new trsuperobject(19,48,9,"Ey Tanrı, tapınağında,Ne kadar vefalı olduğunu düşünüyoruz."));
trsuperobject.biblemap.put("b19_48_10", new trsuperobject(19,48,10,"Adın gibi, ey Tanrı, övgün deDünyanın dört bucağına varıyor.Sağ elin zafer dolu."));
trsuperobject.biblemap.put("b19_48_11", new trsuperobject(19,48,11,"Sevinsin Siyon Dağı,Coşsun Yahuda beldeleriSenin yargılarınla!"));
trsuperobject.biblemap.put("b19_48_12", new trsuperobject(19,48,12,"Siyonun çevresini gezip dolanın,Kulelerini sayın,"));
trsuperobject.biblemap.put("b19_48_13", new trsuperobject(19,48,13,"Surlarına dikkatle bakın,Kalelerini yoklayın ki,Gelecek kuşağa anlatasınız:"));
trsuperobject.biblemap.put("b19_48_14", new trsuperobject(19,48,14,"Bu Tanrı sonsuza dek bizim Tanrımız olacak,Bize hep yol gösterecektir."));
trsuperobject.biblemap.put("b19_49_1", new trsuperobject(19,49,1,"Ey bütün halklar, dinleyin!Kulak verin hepiniz, ey dünyada yaşayanlar,"));
trsuperobject.biblemap.put("b19_49_2", new trsuperobject(19,49,2,"Halk çocukları, bey çocukları,Zenginler, yoksullar!"));
trsuperobject.biblemap.put("b19_49_3", new trsuperobject(19,49,3,"Bilgelik dökülecek ağzımdan,Anlayış sağlayacak içimdeki düşünceler,"));
trsuperobject.biblemap.put("b19_49_4", new trsuperobject(19,49,4,"Kulak vereceğim özdeyişlere,Lirle yorumlayacağım bilmecemi."));
trsuperobject.biblemap.put("b19_49_5", new trsuperobject(19,49,5,"Niçin korkayım kötü günlerdeNiyeti bozuk düşmanlarım çevremi sarınca?"));
trsuperobject.biblemap.put("b19_49_6", new trsuperobject(19,49,6,"Onlar varlıklarına güvenir,Büyük servetleriyle böbürlenirler."));
trsuperobject.biblemap.put("b19_49_7", new trsuperobject(19,49,7,"Kimse kimsenin hayatının bedelini ödeyemez,Tanrıya fidye veremez."));
trsuperobject.biblemap.put("b19_49_8", new trsuperobject(19,49,8,"Çünkü hayatın fidyesi büyüktür,Kimse ödemeye yeltenmemeli."));
trsuperobject.biblemap.put("b19_49_9", new trsuperobject(19,49,9,"Böyle olmasa,Sonsuza dek yaşar insan,Mezar yüzü görmez."));
trsuperobject.biblemap.put("b19_49_10", new trsuperobject(19,49,10,"Kuşkusuz herkes biliyor bilgelerin öldüğünü,Aptallarla budalaların yok olduğunu.Mallarını başkalarına bırakıyorlar."));
trsuperobject.biblemap.put("b19_49_11", new trsuperobject(19,49,11,"Mezarları, sonsuza dek evleri,Kuşaklar boyu konutları olacak,Topraklarına kendi adlarını verseler bile. evleri, kuşaklar boyu konutları olacak››, Masoretik metin ‹‹Evlerimiz sonsuza dek kalacak› diye düşünüyorlar››."));
trsuperobject.biblemap.put("b19_49_12", new trsuperobject(19,49,12,"Bütün gösterişine karşın geçicidir insan,Ölüp giden hayvanlar gibi."));
trsuperobject.biblemap.put("b19_49_13", new trsuperobject(19,49,13,"Budalaların yolu,Onların sözünü onaylayanların sonu budur. Sela"));
trsuperobject.biblemap.put("b19_49_14", new trsuperobject(19,49,14,"Sürü gibi ölüler diyarına sürülecekler,Ölüm güdecek onları.Tan ağarınca doğrular onlara egemen olacak,Cesetleri çürüyecek,Ölüler diyarı onlara konut olacak."));
trsuperobject.biblemap.put("b19_49_15", new trsuperobject(19,49,15,"Ama Tanrı beniÖlüler diyarının pençesinden kurtaracakVe yanına alacak. Sela"));
trsuperobject.biblemap.put("b19_49_16", new trsuperobject(19,49,16,"Korkma biri zenginleşirse,Evinin görkemi artarsa."));
trsuperobject.biblemap.put("b19_49_17", new trsuperobject(19,49,17,"Çünkü ölünce hiçbir şey götüremez,Görkemi onunla mezara gitmez."));
trsuperobject.biblemap.put("b19_49_18", new trsuperobject(19,49,18,"Yaşarken kendini mutlu saysa bile,Başarılı olunca övülse bile."));
trsuperobject.biblemap.put("b19_49_19", new trsuperobject(19,49,19,"Atalarının kuşağına katılacak,Onlar ki asla ışık yüzü görmeyecekler."));
trsuperobject.biblemap.put("b19_49_20", new trsuperobject(19,49,20,"Bütün gösterişine karşın anlayışsızdır insan,Ölüp giden hayvanlar gibi."));
trsuperobject.biblemap.put("b19_50_1", new trsuperobject(19,50,1,"Güçlü olan Tanrı, RAB konuşuyor;Güneşin doğduğu yerden battığı yere kadarYeryüzünün tümüne sesleniyor."));
trsuperobject.biblemap.put("b19_50_2", new trsuperobject(19,50,2,"Güzelliğin doruğu SiyondanParıldıyor Tanrı."));
trsuperobject.biblemap.put("b19_50_3", new trsuperobject(19,50,3,"Tanrımız geliyor, sessiz kalmayacak,Önünde yanan ateş her şeyi kül ediyor,Çevresinde şiddetli bir fırtına esiyor."));
trsuperobject.biblemap.put("b19_50_4", new trsuperobject(19,50,4,"Halkını yargılamak içinYere göğe sesleniyor:"));
trsuperobject.biblemap.put("b19_50_5", new trsuperobject(19,50,5,"‹‹Toplayın önüme sadık kullarımı,Kurban keserek benimle antlaşma yapanları.››"));
trsuperobject.biblemap.put("b19_50_6", new trsuperobject(19,50,6,"Gökler Onun doğruluğunu duyuruyor,Çünkü yargıç Tanrının kendisidir. Sela"));
trsuperobject.biblemap.put("b19_50_7", new trsuperobject(19,50,7,"‹‹Ey halkım, dinle de konuşayım,Ey İsrail, sana karşı tanıklık edeyim:Ben Tanrıyım, senin Tanrınım!"));
trsuperobject.biblemap.put("b19_50_8", new trsuperobject(19,50,8,"Kurbanlarından ötürü seni azarlamıyorum,Yakmalık sunuların sürekli önümde."));
trsuperobject.biblemap.put("b19_50_9", new trsuperobject(19,50,9,"Ne evinden bir boğa,Ne de ağıllarından bir teke alacağım."));
trsuperobject.biblemap.put("b19_50_10", new trsuperobject(19,50,10,"Çünkü bütün orman yaratıkları,Dağlardaki bütün hayvanlar benimdir."));
trsuperobject.biblemap.put("b19_50_11", new trsuperobject(19,50,11,"Dağlardaki bütün kuşları korurum,Kırlardaki bütün yabanıl hayvanlar benimdir."));
trsuperobject.biblemap.put("b19_50_12", new trsuperobject(19,50,12,"Acıksam sana söylemezdim,Çünkü bütün dünya ve içindekiler benimdir."));
trsuperobject.biblemap.put("b19_50_13", new trsuperobject(19,50,13,"Ben boğa eti yer miyim?Ya da keçi kanı içer miyim?"));
trsuperobject.biblemap.put("b19_50_14", new trsuperobject(19,50,14,"Tanrıya şükran kurbanı sun,Yüceler Yücesine adadığın adakları yerine getir."));
trsuperobject.biblemap.put("b19_50_15", new trsuperobject(19,50,15,"Sıkıntılı gününde seslen bana,Seni kurtarırım, sen de beni yüceltirsin."));
trsuperobject.biblemap.put("b19_50_16", new trsuperobject(19,50,16,"Ama Tanrı kötüye şöyle diyor:‹‹Kurallarımı ezbere okumayaYa da antlaşmamı ağzına almaya ne hakkın var?"));
trsuperobject.biblemap.put("b19_50_17", new trsuperobject(19,50,17,"Çünkü yola getirilmekten nefret ediyor,Sözlerimi arkana atıyorsun."));
trsuperobject.biblemap.put("b19_50_18", new trsuperobject(19,50,18,"Hırsız görünce onunla dost oluyor,Zina edenlere ortak oluyorsun."));
trsuperobject.biblemap.put("b19_50_19", new trsuperobject(19,50,19,"Ağzını kötülük için kullanıyor,Dilini yalana koşuyorsun."));
trsuperobject.biblemap.put("b19_50_20", new trsuperobject(19,50,20,"Oturup kardeşine karşı konuşur,Annenin oğluna kara çalarsın."));
trsuperobject.biblemap.put("b19_50_21", new trsuperobject(19,50,21,"Sen bunları yaptın, ben sustum,Beni kendin gibi sandın.Seni azarlıyorum,Suçlarını gözünün önüne seriyorum."));
trsuperobject.biblemap.put("b19_50_22", new trsuperobject(19,50,22,"‹‹Dikkate alın bunu, ey Tanrıyı unutan sizler!Yoksa parçalarım sizi, kurtaran olmaz."));
trsuperobject.biblemap.put("b19_50_23", new trsuperobject(19,50,23,"Kim şükran kurbanı sunarsa beni yüceltir;Yolunu düzeltene kurtarışımı göstereceğim.››"));
trsuperobject.biblemap.put("b19_51_1", new trsuperobject(19,51,1,"Ey Tanrı, lütfet bana,Sevgin uğruna;Sil isyanlarımı,Sınırsız merhametin uğruna."));
trsuperobject.biblemap.put("b19_51_2", new trsuperobject(19,51,2,"Tümüyle yıka beni suçumdan,Arıt beni günahımdan."));
trsuperobject.biblemap.put("b19_51_3", new trsuperobject(19,51,3,"Çünkü biliyorum isyanlarımı,Günahım sürekli karşımda."));
trsuperobject.biblemap.put("b19_51_4", new trsuperobject(19,51,4,"Sana karşı, yalnız sana karşı günah işledim,Senin gözünde kötü olanı yaptım.Öyle ki, konuşurken haklı,Yargılarken adil olasın."));
trsuperobject.biblemap.put("b19_51_5", new trsuperobject(19,51,5,"Nitekim suç içinde doğdum ben,Günah içinde annem bana hamile kaldı."));
trsuperobject.biblemap.put("b19_51_6", new trsuperobject(19,51,6,"Madem sen gönülde sadakat istiyorsun,Bilgelik öğret bana yüreğimin derinliklerinde."));
trsuperobject.biblemap.put("b19_51_7", new trsuperobject(19,51,7,"Beni mercanköşkotuyla arıt, paklanayım,Yıka beni, kardan beyaz olayım."));
trsuperobject.biblemap.put("b19_51_8", new trsuperobject(19,51,8,"Neşe, sevinç sesini duyur bana,Bayram etsin ezdiğin kemikler."));
trsuperobject.biblemap.put("b19_51_9", new trsuperobject(19,51,9,"Bakma günahlarıma,Sil bütün suçlarımı."));
trsuperobject.biblemap.put("b19_51_10", new trsuperobject(19,51,10,"Ey Tanrı, temiz bir yürek yarat,Yeniden kararlı bir ruh var et içimde."));
trsuperobject.biblemap.put("b19_51_11", new trsuperobject(19,51,11,"Beni huzurundan atma,Kutsal Ruhunu benden alma."));
trsuperobject.biblemap.put("b19_51_12", new trsuperobject(19,51,12,"Geri ver bana sağladığın kurtuluş sevincini,Bana destek ol, istekli bir ruh ver."));
trsuperobject.biblemap.put("b19_51_13", new trsuperobject(19,51,13,"Başkaldıranlara senin yollarını öğreteyim,Günahkârlar geri dönsün sana."));
trsuperobject.biblemap.put("b19_51_14", new trsuperobject(19,51,14,"Kurtar beni kan dökme suçundan,Ey Tanrı, beni kurtaran Tanrı,Dilim senin kurtarışını ilahilerle övsün."));
trsuperobject.biblemap.put("b19_51_15", new trsuperobject(19,51,15,"Ya Rab, aç dudaklarımı,Ağzım senin övgülerini duyursun."));
trsuperobject.biblemap.put("b19_51_16", new trsuperobject(19,51,16,"Çünkü sen kurbandan hoşlanmazsın,Yoksa sunardım sana,Yakmalık sunudan hoşnut kalmazsın."));
trsuperobject.biblemap.put("b19_51_17", new trsuperobject(19,51,17,"Senin kabul ettiğin kurban alçakgönüllü bir ruhtur,Alçakgönüllü ve pişman bir yüreği hor görmezsin, ey Tanrı."));
trsuperobject.biblemap.put("b19_51_18", new trsuperobject(19,51,18,"Lütfet, Siyona iyilik yap,Yeruşalimin surlarını onar."));
trsuperobject.biblemap.put("b19_51_19", new trsuperobject(19,51,19,"O zaman doğru sunulan kurbanlar,Yakmalık sunular, tümüyle yakmalık sunular,Seni hoşnut kılar;O zaman sunağında boğalar sunulur."));
trsuperobject.biblemap.put("b19_52_1-2", new trsuperobject(19,52,1-2,"Niçin kötülüğünle böbürlenirsin, ey kabadayı,Tanrının sadık kullarına karşıBütün gün dilin yıkım tasarlarKeskin ustura gibi, ey hilekâr."));
trsuperobject.biblemap.put("b19_52_3", new trsuperobject(19,52,3,"İyilikten çok kötülüğü,Doğru konuşmaktan çok yalanı seversin. Sela"));
trsuperobject.biblemap.put("b19_52_4", new trsuperobject(19,52,4,"Seni hileli dil seni!Her yıkıcı sözü seversin."));
trsuperobject.biblemap.put("b19_52_5", new trsuperobject(19,52,5,"Ama Tanrı seni sonsuza dek yıkacak,Seni kapıp çadırından fırlatacak,Yaşam diyarından kökünü sökecek. Sela"));
trsuperobject.biblemap.put("b19_52_6", new trsuperobject(19,52,6,"Doğrular bunu görünce korkacak,Gülerek şöyle diyecekler:"));
trsuperobject.biblemap.put("b19_52_7", new trsuperobject(19,52,7,"‹‹İşte bu adam, Tanrıya sığınmak istemedi,Servetinin bolluğuna güvendi,Başkalarını yıkarak güçlendi!››"));
trsuperobject.biblemap.put("b19_52_8", new trsuperobject(19,52,8,"Ama ben Tanrının evinde yeşeren zeytin ağacı gibiyim,Sonsuza dek Tanrının sevgisine güvenirim."));
trsuperobject.biblemap.put("b19_52_9", new trsuperobject(19,52,9,"Sürekli sana şükrederim yaptıkların için,Sadık kullarının önünde umut bağlarım,Çünkü adın iyidir."));
trsuperobject.biblemap.put("b19_53_1", new trsuperobject(19,53,1,"Akılsız içinden, ‹‹Tanrı yok!›› der.İnsanlar bozuldu, iğrençlik aldı yürüdü,İyilik eden yok. sazlar››."));
trsuperobject.biblemap.put("b19_53_2", new trsuperobject(19,53,2,"Tanrı göklerden bakar oldu insanlara,Akıllı, Tanrıya yönelen biri var mı diye."));
trsuperobject.biblemap.put("b19_53_3", new trsuperobject(19,53,3,"Hepsi saptı,Tümü yozlaştı,İyilik eden yok,Bir kişi bile!"));
trsuperobject.biblemap.put("b19_53_4", new trsuperobject(19,53,4,"Suç işleyenler görmüyor mu?Halkımı ekmek yer gibi yiyor,Tanrıya yakarmıyorlar."));
trsuperobject.biblemap.put("b19_53_5", new trsuperobject(19,53,5,"Ama korkulmayacak yerde korkacaklar,Çünkü Tanrı seni kuşatanların kemiklerini dağıtacak,Onları reddettiği için hepsini utandıracak."));
trsuperobject.biblemap.put("b19_53_6", new trsuperobject(19,53,6,"Keşke İsrail'in kurtuluşu Siyon'dan gelse!Tanrı halkını eski gönencine kavuşturunca,Yakup soyu sevinecek, İsrail halkı coşacak."));
trsuperobject.biblemap.put("b19_54_1", new trsuperobject(19,54,1,"Ey Tanrı, beni adınla kurtar,Gücünle akla beni!"));
trsuperobject.biblemap.put("b19_54_2", new trsuperobject(19,54,2,"Ey Tanrı, duamı dinle,Kulak ver ağzımdan çıkan sözlere."));
trsuperobject.biblemap.put("b19_54_3", new trsuperobject(19,54,3,"Çünkü küstahlar bana saldırıyor,Zorbalar canımı almak istiyor,Tanrıya aldırmıyorlar. Sela"));
trsuperobject.biblemap.put("b19_54_4", new trsuperobject(19,54,4,"İşte Tanrı benim yardımcımdır,Tek desteğim Rabdir."));
trsuperobject.biblemap.put("b19_54_5", new trsuperobject(19,54,5,"Düşmanlarım yaptıkları kötülüğün cezasını bulsun,Sadakatin uyarınca yok et onları."));
trsuperobject.biblemap.put("b19_54_6", new trsuperobject(19,54,6,"Ya RAB, sana gönülden bir kurban sunacağım,Adına şükredeceğim, çünkü adın iyidir."));
trsuperobject.biblemap.put("b19_54_7", new trsuperobject(19,54,7,"Beni bütün sıkıntılarımdan kurtardın,Gözlerim düşmanlarımın yok oluşunu gördü."));
trsuperobject.biblemap.put("b19_55_1", new trsuperobject(19,55,1,"Ey Tanrı, kulak ver duama,Sırt çevirme yalvarışıma!"));
trsuperobject.biblemap.put("b19_55_2", new trsuperobject(19,55,2,"Dikkatini çevir, yanıt ver bana.Düşüncelerim beni rahatsız ediyor, şaşkınım"));
trsuperobject.biblemap.put("b19_55_3", new trsuperobject(19,55,3,"Düşman sesinden, kötünün baskısından;Çünkü sıkıntıya sokuyorlar beni,Öfkeyle üstüme üstüme geliyorlar."));
trsuperobject.biblemap.put("b19_55_4", new trsuperobject(19,55,4,"Yüreğim sızlıyor içimde,Ölüm dehşeti çöktü üzerime."));
trsuperobject.biblemap.put("b19_55_5", new trsuperobject(19,55,5,"Korku ve titreme sardı beni,Ürperti kapladı içimi."));
trsuperobject.biblemap.put("b19_55_6", new trsuperobject(19,55,6,"‹‹Keşke güvercin gibi kanatlarım olsaydı!››Dedim kendi kendime, ‹‹Uçar, rahatlardım."));
trsuperobject.biblemap.put("b19_55_7", new trsuperobject(19,55,7,"Uzaklara kaçar,Çöllerde konaklardım. Sela"));
trsuperobject.biblemap.put("b19_55_8", new trsuperobject(19,55,8,"Sert rüzgara, kasırgaya karşıHemen bir barınak bulurdum.››"));
trsuperobject.biblemap.put("b19_55_9", new trsuperobject(19,55,9,"Şaşkına çevir kötüleri, ya Rab, karıştır dillerini,Çünkü kentte şiddet ve çatışma görüyorum."));
trsuperobject.biblemap.put("b19_55_10", new trsuperobject(19,55,10,"Gece gündüz kent surları üzerinde dolaşırlar,Haksızlık, fesat dolu kentin içi."));
trsuperobject.biblemap.put("b19_55_11", new trsuperobject(19,55,11,"Yıkıcılık kentin göbeğinde,Zorbalık, hile eksilmez meydanından."));
trsuperobject.biblemap.put("b19_55_12", new trsuperobject(19,55,12,"Beni aşağılayan bir düşman olsaydı,Katlanabilirdim;Bana küstahlık eden bir hasım olsaydı,Gizlenebilirdim."));
trsuperobject.biblemap.put("b19_55_13", new trsuperobject(19,55,13,"Ama sensin, bana denk,Yoldaşım, yakın arkadaşım."));
trsuperobject.biblemap.put("b19_55_14", new trsuperobject(19,55,14,"Birlikte tatlı tatlı yarenlik eder,Toplulukla Tanrının evine giderdik."));
trsuperobject.biblemap.put("b19_55_15", new trsuperobject(19,55,15,"Ölüm yakalasın düşmanlarımı ansızın,Diri diri ölüler diyarına insinler;Çünkü içleri ve evleri kötülük dolu."));
trsuperobject.biblemap.put("b19_55_16", new trsuperobject(19,55,16,"Bense Tanrıya seslenirim,RAB kurtarır beni."));
trsuperobject.biblemap.put("b19_55_17", new trsuperobject(19,55,17,"Sabah, öğlen, akşam kederimden feryat ederim,O işitir sesimi."));
trsuperobject.biblemap.put("b19_55_18", new trsuperobject(19,55,18,"Bana karşı girişilen savaştanEsenlikle kurtarır canımı,Sayısı çok da olsa karşıtlarımın."));
trsuperobject.biblemap.put("b19_55_19", new trsuperobject(19,55,19,"Öncesizlikten bu yana tahtında oturan Tanrı,Duyacak ve ezecek onları. SelaÇünkü hiç değişmiyorVe Tanrıdan korkmuyorlar."));
trsuperobject.biblemap.put("b19_55_20", new trsuperobject(19,55,20,"Yoldaşım dostlarına saldırarakYaptığı antlaşmayı bozdu."));
trsuperobject.biblemap.put("b19_55_21", new trsuperobject(19,55,21,"Ağzından bal damlar,Ama yüreğinde savaş var.Sözleri yağdan yumuşak,Ama yalın birer kılıçtır."));
trsuperobject.biblemap.put("b19_55_22", new trsuperobject(19,55,22,"Yükünü RABbe bırak,O sana destek olur.Asla izin vermezDoğru insanın sarsılmasına."));
trsuperobject.biblemap.put("b19_55_23", new trsuperobject(19,55,23,"Ama sen, ey Tanrı, ölüm çukuruna atacaksın kötüleri,Günlerinin yarısını görmeyecek katillerle hainler;Bense sana güveniyorum."));
trsuperobject.biblemap.put("b19_56_1", new trsuperobject(19,56,1,"Acı bana, ey Tanrı,Çünkü ayak altında çiğniyor insanlar beni,Gün boyu saldırıp eziyorlar."));
trsuperobject.biblemap.put("b19_56_2", new trsuperobject(19,56,2,"Düşmanlarım ayak altında çiğniyor beni her gün,Küstahça saldırıyor çoğu."));
trsuperobject.biblemap.put("b19_56_3", new trsuperobject(19,56,3,"Sana güvenirim korktuğum zaman."));
trsuperobject.biblemap.put("b19_56_4", new trsuperobject(19,56,4,"Tanrıya, sözünü övdüğüm TanrıyaGüvenirim ben, korkmam.İnsan bana ne yapabilir?"));
trsuperobject.biblemap.put("b19_56_5", new trsuperobject(19,56,5,"Gün boyu sözlerimi çarpıtıyorlar,Hakkımda hep kötülük tasarlıyorlar."));
trsuperobject.biblemap.put("b19_56_6", new trsuperobject(19,56,6,"Fesatlık için uğraşıyor, pusuya yatıyor,Adımlarımı gözlüyor, canımı almak istiyorlar."));
trsuperobject.biblemap.put("b19_56_7", new trsuperobject(19,56,7,"Kötülüklerinin cezasından kurtulacaklar mı?Ey Tanrı, halkları öfkeyle yere çal!"));
trsuperobject.biblemap.put("b19_56_8", new trsuperobject(19,56,8,"Çektiğim acıları kaydettin,Gözyaşlarımı tulumunda biriktirdin!Bunlar defterinde yazılı değil mi?"));
trsuperobject.biblemap.put("b19_56_9", new trsuperobject(19,56,9,"Seslendiğim zaman,Düşmanlarım geri çekilecek.  Biliyorum, Tanrı benden yana."));
trsuperobject.biblemap.put("b19_56_10", new trsuperobject(19,56,10,"Sözünü övdüğüm Tanrıya,Sözünü övdüğüm RABbe,"));
trsuperobject.biblemap.put("b19_56_11", new trsuperobject(19,56,11,"Tanrıya güvenirim ben, korkmam;İnsan bana ne yapabilir?"));
trsuperobject.biblemap.put("b19_56_12", new trsuperobject(19,56,12,"Ey Tanrı, sana adaklar adamıştım,Şükran kurbanları sunmalıyım şimdi."));
trsuperobject.biblemap.put("b19_56_13", new trsuperobject(19,56,13,"Çünkü canımı ölümden kurtardın,Ayaklarımı tökezlemekten korudun;İşte yaşam ışığında, Tanrı huzurunda yürüyorum."));
trsuperobject.biblemap.put("b19_57_1", new trsuperobject(19,57,1,"Acı bana, ey Tanrı, acı,Çünkü sana sığınıyorum;Felaket geçinceye kadar,Kanatlarının gölgesine sığınacağım."));
trsuperobject.biblemap.put("b19_57_2", new trsuperobject(19,57,2,"Yüce Tanrıya,Benim için her şeyi yapan Tanrıya sesleniyorum."));
trsuperobject.biblemap.put("b19_57_3", new trsuperobject(19,57,3,"Gökten gönderip beni kurtaracak,Beni ezmek isteyenleri azarlayacak, SelaSevgisini, sadakatini gösterecektir."));
trsuperobject.biblemap.put("b19_57_4", new trsuperobject(19,57,4,"Aslanların arasındayım,Alev kusan insanlar arasında yatarım,Mızrak gibi, ok gibi dişleri,Keskin kılıç gibi dilleri."));
trsuperobject.biblemap.put("b19_57_5", new trsuperobject(19,57,5,"Yüceliğini göster göklerin üstünde, ey Tanrı,Görkemin bütün yeryüzünü kaplasın!"));
trsuperobject.biblemap.put("b19_57_6", new trsuperobject(19,57,6,"Ayaklarım için ağ serdiler,Çöktüm;Yoluma çukur kazdılar,İçine kendileri düştüler. Sela"));
trsuperobject.biblemap.put("b19_57_7", new trsuperobject(19,57,7,"Kararlıyım, ey Tanrı, kararlıyım,Ezgiler, ilahiler söyleyeceğim."));
trsuperobject.biblemap.put("b19_57_8", new trsuperobject(19,57,8,"Uyan, ey canım,Uyan, ey lir, ey çenk,Seheri ben uyandırayım!"));
trsuperobject.biblemap.put("b19_57_9", new trsuperobject(19,57,9,"Halkların arasında sana şükürler sunayım, ya Rab,Ulusların arasında seni ilahilerle öveyim."));
trsuperobject.biblemap.put("b19_57_10", new trsuperobject(19,57,10,"Çünkü sevgin göklere erişir,Sadakatin gökyüzüne ulaşır."));
trsuperobject.biblemap.put("b19_57_11", new trsuperobject(19,57,11,"Yüceliğini göster göklerin üstünde, ey Tanrı,Görkemin bütün yeryüzünü kaplasın!"));
trsuperobject.biblemap.put("b19_58_1", new trsuperobject(19,58,1,"Ey yöneticilerfü, gerçekten adil mi karar verirsiniz?Doğru mu yargılarsınız insanları?"));
trsuperobject.biblemap.put("b19_58_2", new trsuperobject(19,58,2,"Hayır! Hep haksızlık tasarlarsınız içinizde,Zorbalık saçar elleriniz yeryüzüne."));
trsuperobject.biblemap.put("b19_58_3", new trsuperobject(19,58,3,"Kötüler daha ana rahmindeyken yoldan çıkar,Doğdu doğalı yalan söyleyerek sapar."));
trsuperobject.biblemap.put("b19_58_4", new trsuperobject(19,58,4,"Zehirleri yılan zehiri gibidir.Kulakları tıkalı bir kobrayı andırırlar,"));
trsuperobject.biblemap.put("b19_58_5", new trsuperobject(19,58,5,"Usta büyücülerin,Afsuncuların sesini duymak istemeyen bir kobrayı."));
trsuperobject.biblemap.put("b19_58_6", new trsuperobject(19,58,6,"Ey Tanrı, kır onların ağzında dişlerini,Sök genç aslanların azı dişlerini, ya RAB!"));
trsuperobject.biblemap.put("b19_58_7", new trsuperobject(19,58,7,"Akıp giden su gibi yok olsunlar.Yaylarını gerince oklarının ucu kırılsın."));
trsuperobject.biblemap.put("b19_58_8", new trsuperobject(19,58,8,"Süründükçe eriyen sümüklüböceğe dönsünler.Düşük çocuk gibi güneş yüzü görmesinler."));
trsuperobject.biblemap.put("b19_58_9", new trsuperobject(19,58,9,"Kazanlarınız diken ateşini daha duymadan,Yaşı da kurusu da kasırgayla savrulacak kötülerin."));
trsuperobject.biblemap.put("b19_58_10", new trsuperobject(19,58,10,"Doğru adam alınan öcü görünce sevinecekVe ayaklarını kötünün kanında yıkayacak."));
trsuperobject.biblemap.put("b19_58_11", new trsuperobject(19,58,11,"O zaman insanlar, ‹‹Gerçekten doğrulara ödül var›› diyecek,‹‹Gerçekten dünyayı yargılayan bir Tanrı var.››"));
trsuperobject.biblemap.put("b19_59_1", new trsuperobject(19,59,1,"Kurtar beni düşmanlarımdan, ey Tanrım,Kalem ol hasımlarıma karşı."));
