trsuperobject.biblemap.put("b19_68_4", new trsuperobject(19,68,4,"Tanrıya ezgiler söyleyin, adını ilahilerle övün,Çölleri geçecek biniciye yol hazırlayın;Onun adı RABdir, bayram edin önünde! ‹‹Bulutlara binmiş olana ezgiler sunun››."));
trsuperobject.biblemap.put("b19_68_5", new trsuperobject(19,68,5,"Kutsal konutundaki Tanrı,Öksüzlerin babası, dul kadınların savunucusudur."));
trsuperobject.biblemap.put("b19_68_6", new trsuperobject(19,68,6,"Tanrı kimsesizlere ev verir,Tutsakları özgürlüğe ve gönence kavuşturur,Ama başkaldıranlar kurak yerde oturur."));
trsuperobject.biblemap.put("b19_68_7", new trsuperobject(19,68,7,"Ey Tanrı, sen halkına öncülük ettiğinde,Çölde yürüdüğünde, Sela"));
trsuperobject.biblemap.put("b19_68_8", new trsuperobject(19,68,8,"Yer sarsıldı,Göklerden yağmur boşandı Tanrının önünde,Sina Dağı sarsıldıTanrının, İsrailin Tanrısının önünde."));
trsuperobject.biblemap.put("b19_68_9", new trsuperobject(19,68,9,"Bol yağmurlar yağdırdın, ey Tanrı,Canlandırdın yorgun düşen yurdunu."));
trsuperobject.biblemap.put("b19_68_10", new trsuperobject(19,68,10,"Halkın oraya yerleşti,İyiliğinle mazlumların geçimini sağladın, ey Tanrı."));
trsuperobject.biblemap.put("b19_68_11", new trsuperobject(19,68,11,"Rab buyruk verdi,Büyük bir kadın topluluğu duyurdu müjdeyi:"));
trsuperobject.biblemap.put("b19_68_12", new trsuperobject(19,68,12,"‹‹Kaçıyor, kaçıyor orduların kralları!Evi bekleyen kadınlar ganimeti paylaşıyor."));
trsuperobject.biblemap.put("b19_68_13", new trsuperobject(19,68,13,"Ağılların arasında uyurken,Kanatları gümüş, tüyleri pırıl pırıl altınla kaplıBir güvercine benzersiniz.››"));
trsuperobject.biblemap.put("b19_68_14", new trsuperobject(19,68,14,"Her Şeye Gücü Yeten, kralları dağıtırken,Sanki Salmon Dağına kar yağıyordu."));
trsuperobject.biblemap.put("b19_68_15", new trsuperobject(19,68,15,"Ey Başan Dağı, Tanrı Dağı!Ey Başan Dağı, dorukları ulu dağ!"));
trsuperobject.biblemap.put("b19_68_16", new trsuperobject(19,68,16,"Ey ulu dağlar, niçin yan gözle bakıyorsunuzTanrının yerleşmek için seçtiği dağa?Evet, RAB orada sonsuza dek oturacaktır."));
trsuperobject.biblemap.put("b19_68_17", new trsuperobject(19,68,17,"Tanrının savaş arabaları sayısızdır,Rab kutsallık içinde Sinadan geldi."));
trsuperobject.biblemap.put("b19_68_18", new trsuperobject(19,68,18,"Sen yükseğe çıktın, tutsakları peşine taktın,İnsanlardan, başkaldıranlardan bile armağanlar aldın,Oraya yerleşmek için, ya RAB Tanrı."));
trsuperobject.biblemap.put("b19_68_19", new trsuperobject(19,68,19,"Her gün yükümüzü taşıyan Rabbe,Bizi kurtaran Tanrıya övgüler olsun. Sela"));
trsuperobject.biblemap.put("b19_68_20", new trsuperobject(19,68,20,"Tanrımız kurtarıcı bir Tanrıdır,Ölümden kurtarış yalnız Egemen RABbe özgüdür."));
trsuperobject.biblemap.put("b19_68_21", new trsuperobject(19,68,21,"Kuşkusuz Tanrı düşmanlarının başını,Suçlu yaşayanların kıllı kafasını ezer."));
trsuperobject.biblemap.put("b19_68_22", new trsuperobject(19,68,22,"Rab, ‹‹Onları Başandan,Denizin derinliklerinden geri getireceğim›› der,"));
trsuperobject.biblemap.put("b19_68_23", new trsuperobject(19,68,23,"‹‹Öyle ki, ayaklarını düşmanlarının kanına batırasın,Köpeklerinin dili de onlardan payını alsın.››"));
trsuperobject.biblemap.put("b19_68_24", new trsuperobject(19,68,24,"Ey Tanrı, senin zafer alayını,Tanrımın, Kralımın kutsal yere törenle gelişini gördüler:"));
trsuperobject.biblemap.put("b19_68_25", new trsuperobject(19,68,25,"Başta okuyucular, arkada çalgıcılar,Ortada tef çalan genç kızlar."));
trsuperobject.biblemap.put("b19_68_26", new trsuperobject(19,68,26,"‹‹Ey sizler, İsrail soyundan gelenler,Toplantılarınızda Tanrıya, RABbe övgüler sunun!››"));
trsuperobject.biblemap.put("b19_68_27", new trsuperobject(19,68,27,"Önde en küçük oymak Benyamin,Kalabalık halinde Yahuda önderleri,Zevulun ve Naftali önderleri oradalar!"));
trsuperobject.biblemap.put("b19_68_28-29", new trsuperobject(19,68,28-29,"Ey Tanrı, Yeruşalimdeki tapınağından göster gücünü,Bizim için kullandığın gücünü, ey Tanrı.Krallar sana armağanlar sunacak."));
trsuperobject.biblemap.put("b19_68_30", new trsuperobject(19,68,30,"Azarla kamışlar arasında yaşayan hayvanı,Halkların buzağılarıyla boğalar sürüsünü,Çiğne ayaklarınla gümüşe gönül verenleri,Dağıt savaştan zevk alan halkları! boğalar›› ise irili ufaklı ulusları simgelemektedir."));
trsuperobject.biblemap.put("b19_68_31", new trsuperobject(19,68,31,"Mısırdan elçiler gelecek,Kûşlular ellerini Tanrıya doğru kaldırıverecek."));
trsuperobject.biblemap.put("b19_68_32", new trsuperobject(19,68,32,"Ey yeryüzünün krallıkları, Tanrıya ezgiler söyleyin,İlahilerle övün Rabbi, Sela"));
trsuperobject.biblemap.put("b19_68_33", new trsuperobject(19,68,33,"Göklere, kadim göklere binmiş olanı.İşte sesiyle, güçlü sesiyle gürlüyor!"));
trsuperobject.biblemap.put("b19_68_34", new trsuperobject(19,68,34,"Tanrının gücünü tanıyın;Onun yüceliği İsrailin üzerinde,Gücü göklerdedir."));
trsuperobject.biblemap.put("b19_68_35", new trsuperobject(19,68,35,"Ne heybetlisin, ey Tanrı, tapınağında!İsrail'in Tanrısı'na,Halkına güç, kudret veren Tanrı'ya övgüler olsun!"));
trsuperobject.biblemap.put("b19_69_1", new trsuperobject(19,69,1,"Kurtar beni, ey Tanrı,Sular boyuma ulaştı."));
trsuperobject.biblemap.put("b19_69_2", new trsuperobject(19,69,2,"Dipsiz batağa gömülüyorum,Basacak yer yok.Derin sulara battım,Sellere kapıldım."));
trsuperobject.biblemap.put("b19_69_3", new trsuperobject(19,69,3,"Tükendim feryat etmekten,Boğazım kurudu;Gözlerimin feri sönüyorTanrımı beklemekten."));
trsuperobject.biblemap.put("b19_69_4", new trsuperobject(19,69,4,"Yok yere benden nefret edenlerSaçlarımdan daha çok.Kalabalıktır canıma kasteden haksız düşmanlarım.Çalmadığım malı nasıl geri verebilirim?"));
trsuperobject.biblemap.put("b19_69_5", new trsuperobject(19,69,5,"Akılsızlığımı biliyorsun, ey Tanrı,Suçlarım senden gizli değil."));
trsuperobject.biblemap.put("b19_69_6", new trsuperobject(19,69,6,"Ya Rab, Her Şeye Egemen RAB,Utanmasın sana umut bağlayanlar benim yüzümden!Ey İsrailin Tanrısı,Benim yüzümden sana yönelenler rezil olmasın!"));
trsuperobject.biblemap.put("b19_69_7", new trsuperobject(19,69,7,"Senin uğruna hakarete katlandım,Utanç kapladı yüzümü."));
trsuperobject.biblemap.put("b19_69_8", new trsuperobject(19,69,8,"Kardeşlerime yabancı,Annemin öz oğullarına uzak kaldım."));
trsuperobject.biblemap.put("b19_69_9", new trsuperobject(19,69,9,"Çünkü evin için gösterdiğim gayret beni yiyip bitirdi,Sana edilen hakaretlere ben uğradım."));
trsuperobject.biblemap.put("b19_69_10", new trsuperobject(19,69,10,"Oruç tutup ağlayınca,Yine hakarete uğradım."));
trsuperobject.biblemap.put("b19_69_11", new trsuperobject(19,69,11,"Çula büründüğüm zamanAlay konusu oldum."));
trsuperobject.biblemap.put("b19_69_12", new trsuperobject(19,69,12,"Kent kapısında oturanlar beni çekiştiriyor,Sarhoşların türküsü oldum."));
trsuperobject.biblemap.put("b19_69_13", new trsuperobject(19,69,13,"Ama benim duam sanadır, ya RAB.Ey Tanrı, sevginin bolluğuyla,Güvenilir kurtarışınla uygun gördüğündeYanıtla beni."));
trsuperobject.biblemap.put("b19_69_14", new trsuperobject(19,69,14,"Beni çamurdan kurtar,İzin verme batmama;Benden nefret edenlerden,Derin sulardan kurtulayım."));
trsuperobject.biblemap.put("b19_69_15", new trsuperobject(19,69,15,"Seller beni sürüklemesin,Engin beni yutmasın,Ölüm çukuru ağzını üstüme kapamasın."));
trsuperobject.biblemap.put("b19_69_16", new trsuperobject(19,69,16,"Yanıt ver bana, ya RAB,Çünkü sevgin iyidir.Yüzünü çevir bana büyük merhametinle!"));
trsuperobject.biblemap.put("b19_69_17", new trsuperobject(19,69,17,"Kulundan yüzünü gizleme,Çünkü sıkıntıdayım, hemen yanıtla beni!"));
trsuperobject.biblemap.put("b19_69_18", new trsuperobject(19,69,18,"Yaklaş bana, kurtar canımı,Al başımdan düşmanlarımı."));
trsuperobject.biblemap.put("b19_69_19", new trsuperobject(19,69,19,"Bana nasıl hakaret edildiğini,Utandığımı, rezil olduğumu biliyorsun;Düşmanlarımın hepsi senin önünde."));
trsuperobject.biblemap.put("b19_69_20", new trsuperobject(19,69,20,"Hakaret kalbimi kırdı, dertliyim,Acılarımı paylaşacak birini bekledim, çıkmadı,Avutacak birini aradım, bulamadım."));
trsuperobject.biblemap.put("b19_69_21", new trsuperobject(19,69,21,"Yiyeceğime zehir kattılar,Sirke içirdiler susadığımda."));
trsuperobject.biblemap.put("b19_69_22", new trsuperobject(19,69,22,"Önlerindeki sofra tuzak olsun onlara,Yandaşları için kapan olsun!"));
trsuperobject.biblemap.put("b19_69_23", new trsuperobject(19,69,23,"Gözleri kararsın, göremesinler!Bellerini hep bükük tut!"));
trsuperobject.biblemap.put("b19_69_24", new trsuperobject(19,69,24,"Gazabını yağdır üzerlerine,Öfkenin ateşi yapışsın yakalarına!"));
trsuperobject.biblemap.put("b19_69_25", new trsuperobject(19,69,25,"Issız kalsın konakları,Çadırlarında oturan olmasın!"));
trsuperobject.biblemap.put("b19_69_26", new trsuperobject(19,69,26,"Çünkü senin vurduğun insanlara zulmediyor,Yaraladığın insanların acısını konuşuyorlar."));
trsuperobject.biblemap.put("b19_69_27", new trsuperobject(19,69,27,"Ceza yağdır başlarına,Senin tarafından aklanmasınlar!"));
trsuperobject.biblemap.put("b19_69_28", new trsuperobject(19,69,28,"Yaşam kitabından silinsin adları,Doğrularla yan yana yazılmasınlar!"));
trsuperobject.biblemap.put("b19_69_29", new trsuperobject(19,69,29,"Bense ezilmiş ve kederliyim,Senin kurtarışın, ey Tanrı, bana bir kale olsun!"));
trsuperobject.biblemap.put("b19_69_30", new trsuperobject(19,69,30,"Tanrının adını ezgilerle öveceğim,Şükranlarımla Onu yücelteceğim."));
trsuperobject.biblemap.put("b19_69_31", new trsuperobject(19,69,31,"RABbi bir öküzden,Boynuzlu, tırnaklı bir boğadanDaha çok hoşnut eder bu."));
trsuperobject.biblemap.put("b19_69_32", new trsuperobject(19,69,32,"Mazlumlar bunu görünce sevinsin,Ey Tanrıya yönelen sizler, yüreğiniz canlansın."));
trsuperobject.biblemap.put("b19_69_33", new trsuperobject(19,69,33,"Çünkü RAB yoksulları işitir,Kendi tutsak halkını hor görmez."));
trsuperobject.biblemap.put("b19_69_34", new trsuperobject(19,69,34,"Ona övgüler sunun, ey yer, gök,Denizler ve onlardaki bütün canlılar!"));
trsuperobject.biblemap.put("b19_69_35", new trsuperobject(19,69,35,"Çünkü Tanrı Siyonu kurtaracak,Yahuda kentlerini onaracak;Halk oraya yerleşip sahibi olacak."));
trsuperobject.biblemap.put("b19_69_36", new trsuperobject(19,69,36,"Kullarının çocukları orayı miras alacak,O'nun adını sevenler orada oturacak."));
trsuperobject.biblemap.put("b19_70_1", new trsuperobject(19,70,1,"Ey Tanrı, kurtar beni!Yardımıma koş, ya RAB!"));
trsuperobject.biblemap.put("b19_70_2", new trsuperobject(19,70,2,"Utansın canımı almaya çalışanlar,Yüzleri kızarsın!Geri dönsün zararımı isteyenler,Rezil olsunlar!"));
trsuperobject.biblemap.put("b19_70_3", new trsuperobject(19,70,3,"Bana, ‹‹Oh! Oh!›› çekenlerGeri çekilsin utançlarından!"));
trsuperobject.biblemap.put("b19_70_4", new trsuperobject(19,70,4,"Sende neşe ve sevinç bulsunBütün sana yönelenler!‹‹Tanrı yücedir!›› desin hepSenin kurtarışını özleyenler!"));
trsuperobject.biblemap.put("b19_70_5", new trsuperobject(19,70,5,"Bense, mazlum ve yoksulum,Ey Tanrı, yardımıma koş!Yardımcım ve kurtarıcım sensin,Geç kalma, ya RAB!"));
trsuperobject.biblemap.put("b19_71_1", new trsuperobject(19,71,1,"Ya RAB, sana sığınıyorum,Utandırma beni hiçbir zaman!"));
trsuperobject.biblemap.put("b19_71_2", new trsuperobject(19,71,2,"Adaletinle kurtar beni, tehlikeden uzaklaştır,Kulak ver bana, kurtar beni!"));
trsuperobject.biblemap.put("b19_71_3", new trsuperobject(19,71,3,"Sığınacak kayam ol,Her zaman başvurabileceğim;Buyruk ver, kurtulayım,Çünkü kayam ve kalem sensin."));
trsuperobject.biblemap.put("b19_71_4", new trsuperobject(19,71,4,"Ey Tanrım, kurtar beniKötünün elinden, haksızın, gaddarın pençesinden!"));
trsuperobject.biblemap.put("b19_71_5", new trsuperobject(19,71,5,"Çünkü umudum sensin, ey Egemen RAB,Gençliğimden beri dayanağım sensin."));
trsuperobject.biblemap.put("b19_71_6", new trsuperobject(19,71,6,"Doğduğum günden beri sana güveniyorum,Beni ana rahminden çıkaran sensin.Övgülerim hep sanadır."));
trsuperobject.biblemap.put("b19_71_7", new trsuperobject(19,71,7,"Birçokları için iyi bir örnek oldum,Çünkü sen güçlü sığınağımsın."));
trsuperobject.biblemap.put("b19_71_8", new trsuperobject(19,71,8,"Ağzımdan sana övgü eksilmez,Gün boyu yüceliğini anarım."));
trsuperobject.biblemap.put("b19_71_9", new trsuperobject(19,71,9,"Yaşlandığımda beni reddetme,Gücüm tükendiğinde beni terk etme!"));
trsuperobject.biblemap.put("b19_71_10", new trsuperobject(19,71,10,"Çünkü düşmanlarım benden söz ediyor,Beni öldürmek isteyenler birbirine danışıyor,"));
trsuperobject.biblemap.put("b19_71_11", new trsuperobject(19,71,11,"‹‹Tanrı onu terk etti›› diyorlar,‹‹Kovalayıp yakalayın,Kurtaracak kimsesi yok!››"));
trsuperobject.biblemap.put("b19_71_12", new trsuperobject(19,71,12,"Ey Tanrı, benden uzak durma,Tanrım, yardımıma koş!"));
trsuperobject.biblemap.put("b19_71_13", new trsuperobject(19,71,13,"Utansın, yok olsun beni suçlayanlar,Utanca, rezalete bürünsün kötülüğümü isteyenler."));
trsuperobject.biblemap.put("b19_71_14", new trsuperobject(19,71,14,"Ama ben her zaman umutluyum,Sana övgü üstüne övgü dizeceğim."));
trsuperobject.biblemap.put("b19_71_15", new trsuperobject(19,71,15,"Gün boyu senin zaferini,Kurtarışını anlatacağım,Ölçüsünü bilmesem de."));
trsuperobject.biblemap.put("b19_71_16", new trsuperobject(19,71,16,"Ey Egemen RAB, gelip yiğitliklerini,Senin, yalnız senin zaferini duyuracağım."));
trsuperobject.biblemap.put("b19_71_17", new trsuperobject(19,71,17,"Ey Tanrı, çocukluğumdan beri beni sen yetiştirdin,Senin harikalarını hâlâ anlatıyorum."));
trsuperobject.biblemap.put("b19_71_18", new trsuperobject(19,71,18,"Yaşlanıp saçlarıma ak düşse bileTerk etme beni, ey Tanrı,Gücünü gelecek kuşağa,Kudretini sonrakilere anlatana dek."));
trsuperobject.biblemap.put("b19_71_19", new trsuperobject(19,71,19,"Ey Tanrı, doğruluğun göklere erişiyor,Büyük işler yaptın,Senin gibisi var mı, ey Tanrı?"));
trsuperobject.biblemap.put("b19_71_20", new trsuperobject(19,71,20,"Sen ki, bana birçok kötü sıkıntı gösterdin,Bana yeniden yaşam verecek,Beni toprağın derinliklerinden çıkaracaksın."));
trsuperobject.biblemap.put("b19_71_21", new trsuperobject(19,71,21,"Saygınlığımı artıracak,Yine beni avutacaksın."));
trsuperobject.biblemap.put("b19_71_22", new trsuperobject(19,71,22,"Ben de seni,Senin sadakatini çenkle öveceğim, ey Tanrım,Lir çalarak seni ilahilerle öveceğim,Ey İsrailin Kutsalı!"));
trsuperobject.biblemap.put("b19_71_23", new trsuperobject(19,71,23,"Seni ilahilerle överken,Dudaklarımla, varlığımla sevincimi dile getireceğim,Çünkü sen beni kurtardın."));
trsuperobject.biblemap.put("b19_71_24", new trsuperobject(19,71,24,"Dilim gün boyu senin zaferinden söz edecek,Çünkü kötülüğümü isteyenlerUtanıp rezil oldu."));
trsuperobject.biblemap.put("b19_72_1", new trsuperobject(19,72,1,"Ey Tanrı, adaletini krala,Doğruluğunu kral oğluna armağan et."));
trsuperobject.biblemap.put("b19_72_2", new trsuperobject(19,72,2,"Senin halkını doğrulukla,Mazlum kullarını adilce yargılasın!"));
trsuperobject.biblemap.put("b19_72_3", new trsuperobject(19,72,3,"Dağlar, tepeler,Halka adilce gönenç getirsin!"));
trsuperobject.biblemap.put("b19_72_4", new trsuperobject(19,72,4,"Mazlumlara hakkını versin,Yoksulların çocuklarını kurtarsın,Zalimleriyse ezsin!"));
trsuperobject.biblemap.put("b19_72_5", new trsuperobject(19,72,5,"Güneş ve ay durdukça,Kral kuşaklar boyunca yaşasın; metin ‹‹Kuşaklar boyunca senden korksunlar.››"));
trsuperobject.biblemap.put("b19_72_6", new trsuperobject(19,72,6,"Yeni biçilmiş çayıra düşen yağmur gibi,Toprağı sulayan bereketli yağmurlar gibi olsun!"));
trsuperobject.biblemap.put("b19_72_7", new trsuperobject(19,72,7,"Onun günlerinde doğruluk serpilip gelişsin,Ay ışıdığı sürece esenlik artsın!"));
trsuperobject.biblemap.put("b19_72_8", new trsuperobject(19,72,8,"Egemenlik sürsün denizden denize,Fırattan yeryüzünün ucuna dek!"));
trsuperobject.biblemap.put("b19_72_9", new trsuperobject(19,72,9,"Çöl kabileleri diz çöksün önünde,Düşmanları toz yalasın."));
trsuperobject.biblemap.put("b19_72_10", new trsuperobject(19,72,10,"Tarşişin ve kıyı ülkelerinin krallarıOna haraç getirsin,Saba ve Seva kralları armağanlar sunsun!"));
trsuperobject.biblemap.put("b19_72_11", new trsuperobject(19,72,11,"Bütün krallar önünde yere kapansın,Bütün uluslar ona kulluk etsin!"));
trsuperobject.biblemap.put("b19_72_12", new trsuperobject(19,72,12,"Çünkü yardım isteyen yoksulu,Dayanağı olmayan düşkünü o kurtarır."));
trsuperobject.biblemap.put("b19_72_13", new trsuperobject(19,72,13,"Yoksula, düşküne acır,Düşkünlerin canını kurtarır."));
trsuperobject.biblemap.put("b19_72_14", new trsuperobject(19,72,14,"Baskıdan, zorbalıktan özgür kılar onları,Çünkü onun gözünde onların kanı değerlidir."));
trsuperobject.biblemap.put("b19_72_15", new trsuperobject(19,72,15,"Yaşasın kral!Ona Saba altını versinler;Durmadan dua etsinler onun için,Gün boyu onu övsünler!"));
trsuperobject.biblemap.put("b19_72_16", new trsuperobject(19,72,16,"Ülkede bol buğday olsun,Dağ başlarında dalgalansın!Başakları Lübnan gibi verimli olsun,Kent halkı ot gibi serpilip çoğalsın!"));
trsuperobject.biblemap.put("b19_72_17", new trsuperobject(19,72,17,"Kralın adı sonsuza dek yaşasın,Güneş durdukça adı var olsun,Onun aracılığıyla insanlar kutsansın,Bütün uluslar ‹‹Ne mutlu ona›› desin!"));
trsuperobject.biblemap.put("b19_72_18", new trsuperobject(19,72,18,"RAB Tanrıya, İsrailin Tanrısına övgüler olsun,Harikalar yaratan yalnız Odur."));
trsuperobject.biblemap.put("b19_72_19", new trsuperobject(19,72,19,"Yüce adına sonsuza dek övgüler olsun,Bütün yeryüzü Onun yüceliğiyle dolsun!Amin! Amin!"));
trsuperobject.biblemap.put("b19_72_20", new trsuperobject(19,72,20,"İşay oğlu Davut'un duaları burada bitiyor."));
