trsuperobject.biblemap.put("b19_73_4", new trsuperobject(19,73,4,"Onlar acı nedir bilmezler,Bedenleri sağlıklı ve semizdirfç. semizdir›› ya da ‹‹Ölürken acı çekmezler, bedenleri semizdir››."));
trsuperobject.biblemap.put("b19_73_5", new trsuperobject(19,73,5,"Başkalarının derdini bilmez,Onlar gibi çile çekmezler."));
trsuperobject.biblemap.put("b19_73_6", new trsuperobject(19,73,6,"Bu yüzden gurur onların gerdanlığı,Zorbalık onları örten bir giysi gibidir."));
trsuperobject.biblemap.put("b19_73_7", new trsuperobject(19,73,7,"Şişmanlıktan gözleri dışarı fırlar,İçleri kötülük kazanı gibi kaynar."));
trsuperobject.biblemap.put("b19_73_8", new trsuperobject(19,73,8,"İnsanlarla eğlenir, kötü niyetle konuşur,Tepeden bakar, baskıyla tehdit ederler."));
trsuperobject.biblemap.put("b19_73_9", new trsuperobject(19,73,9,"Göklere karşı ağızlarını açarlar,Boş sözleri yeryüzünü dolaşır."));
trsuperobject.biblemap.put("b19_73_10", new trsuperobject(19,73,10,"Bu yüzden halk onlardan yana döner,Sözlerini ağzı açık dinler."));
