trsuperobject.biblemap.put("b19_73_12", new trsuperobject(19,73,12,"İşte böyledir kötüler,Hep tasasız, sürekli varlıklarını artırırlar."));
trsuperobject.biblemap.put("b19_73_13", new trsuperobject(19,73,13,"Anlaşılan boş yere yüreğimi temiz tutmuşum,Ellerimi yıkamışım suçsuzum diye."));
trsuperobject.biblemap.put("b19_73_14", new trsuperobject(19,73,14,"Gün boyu içim içimi yiyor,Her sabah azap çekiyorum."));
trsuperobject.biblemap.put("b19_73_15", new trsuperobject(19,73,15,"‹‹Ben de onlar gibi konuşayım›› deseydim,Senin çocuklarına ihanet etmiş olurdum."));
trsuperobject.biblemap.put("b19_73_16", new trsuperobject(19,73,16,"Bunu anlamak için düşündüğümde,Zor geldi bana,"));
trsuperobject.biblemap.put("b19_73_17", new trsuperobject(19,73,17,"Tanrının Tapınağına girene dek;O zaman anladım sonlarının ne olacağını."));
trsuperobject.biblemap.put("b19_73_18", new trsuperobject(19,73,18,"Gerçekten onları kaygan yere koyuyor,Yıkıma sürüklüyorsun."));
trsuperobject.biblemap.put("b19_73_19", new trsuperobject(19,73,19,"Nasıl da bir anda yok oluyor,Siliniveriyorlar dehşet içinde!"));
trsuperobject.biblemap.put("b19_73_20", new trsuperobject(19,73,20,"Uyanan birisi için rüya nasılsa,Sen de uyanınca, ya Rab,Hor göreceksin onların görüntüsünü."));
trsuperobject.biblemap.put("b19_73_21", new trsuperobject(19,73,21,"Kalbim kırıldığında,İçim acı dolduğunda,"));
trsuperobject.biblemap.put("b19_73_22", new trsuperobject(19,73,22,"Akılsız ve bilgisizdim,Karşında bir hayvan gibi."));
trsuperobject.biblemap.put("b19_73_23", new trsuperobject(19,73,23,"Yine de sürekli seninleyim,Sağ elimden tutarsın beni."));
trsuperobject.biblemap.put("b19_73_24", new trsuperobject(19,73,24,"Öğütlerinle yol gösterir,Beni sonunda yüceliğe eriştirirsin."));
trsuperobject.biblemap.put("b19_73_25", new trsuperobject(19,73,25,"Senden başka kimim var göklerde?İstemem senden başkasını yeryüzünde."));
trsuperobject.biblemap.put("b19_73_26", new trsuperobject(19,73,26,"Bedenim ve yüreğim tükenebilir,Ama Tanrı yüreğimde güç,Bana düşen paydır sonsuza dek."));
trsuperobject.biblemap.put("b19_73_27", new trsuperobject(19,73,27,"Kuşkusuz yok olacak senden uzak duranlar,Ortadan kaldıracaksın sana vefasızlık edenleri."));
trsuperobject.biblemap.put("b19_73_28", new trsuperobject(19,73,28,"Ama benim için en iyisi Tanrı'ya yakın olmaktır;Bütün işlerini duyurayım diyeSığınak yaptım Egemen RAB'bi kendime."));
trsuperobject.biblemap.put("b19_74_1", new trsuperobject(19,74,1,"Ey Tanrı, neden bizi sonsuza dek reddettin?Niçin otlağının koyunlarına karşı öfken tütmekte?"));
trsuperobject.biblemap.put("b19_74_2", new trsuperobject(19,74,2,"Anımsa geçmişte sahiplendiğin topluluğu,Kendi halkın olsun diye kurtardığın oymağıVe üzerine konut kurduğun Siyon Dağını."));
trsuperobject.biblemap.put("b19_74_3", new trsuperobject(19,74,3,"Yönelt adımlarını şu onarılmaz yıkıntılara doğru,Düşman kutsal yerdeki her şeyi yıktı."));
