trsuperobject.biblemap.put("b19_74_8", new trsuperobject(19,74,8,"İçlerinden, ‹‹Hepsini ezelim!›› dediler.Ülkede Tanrıyla buluşma yerlerinin tümünü yaktılar."));
trsuperobject.biblemap.put("b19_74_9", new trsuperobject(19,74,9,"Artık kutsal simgelerimizi görmüyoruz,Peygamberler de yok oldu,İçimizden kimse bilmiyor ne zamana dek..."));
