trsuperobject.biblemap.put("b19_74_20", new trsuperobject(19,74,20,"Yaptığın antlaşmayı gözönüne al,Çünkü ülkenin her karanlık köşesiZorbaların inleriyle dolmuş."));
trsuperobject.biblemap.put("b19_74_21", new trsuperobject(19,74,21,"Düşkünler boynu bükük geri çevrilmesin,Mazlumlar, yoksullar adına övgüler dizsin."));
trsuperobject.biblemap.put("b19_74_22", new trsuperobject(19,74,22,"Kalk, ey Tanrı, davanı savun!Anımsa akılsızların gün boyu sana nasıl sövdüğünü!"));
