trsuperobject.biblemap.put("b19_78_6", new trsuperobject(19,78,6,"Öyle ki, gelecek kuşak, yeni doğacak çocuklar bilsinler,Onlar da kendi çocuklarına anlatsınlar,"));
trsuperobject.biblemap.put("b19_78_7", new trsuperobject(19,78,7,"Tanrıya güven duysunlar,Tanrının yaptıklarını unutmasınlar,Onun buyruklarını yerine getirsinler;"));
