trsuperobject.biblemap.put("b19_78_17", new trsuperobject(19,78,17,"Ama onlar çölde Yüceler Yücesine başkaldırarakGünah işlemeye devam ettiler."));
trsuperobject.biblemap.put("b19_78_18", new trsuperobject(19,78,18,"Canlarının çektiği yiyeceği isteyerekİçlerinde Tanrıyı denediler."));
